(1,40,'3rd Party Component Compatibility','3rd-party-component-compatibility','This template is compatible with all the major 3rd party components available for Joomla. The following are just some of the ones available that work great with any Shape 5 template. A template itself should in no way hinder the functionality of a component. Although we haven&#39;t tested every single Joomla component available we can say quite confidently that this template will be compatible with any Joomla extension you use with it.</p>\r\n<p> </p>\r\n<p><img src=\"http://www.shape5.com/demo/images/general/3rdparty.png\" border=\"0\" /><br />And many more!','',1,10,'2013-05-12 03:28:34',809,'','2013-06-11 17:31:03',516,0,'0000-00-00 00:00:00','2013-05-12 03:28:34','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,42,'','',1,731,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(2,41,'Built In File Compression','built-in-file-compression','Increase speed and performance by compressing core template CSS and Javascript files to much smaller sizes than the original! Enabling compression is a great way to boost your site\'s performance. It simply combines css and js into consolidated files. This reduces the downloads sizes and reduces the numbers of calls to your server, to dramatically help your site\'s overall performance. No data is lost during this process, just simply made smaller. Please note that this compression will only compress core template files, not third party files or files from extensions.\r\n<p><br /> <img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/file_compression.jpg\" border=\"0\" alt=\"\" /></p>\r\n<div style=\"clear: both;\"> </div>\r\n<br />\r\n<div class=\"red_box\"><span>Note: Because this feature uses cached versions of your javascript and css this plugin should not be used while developing your site and should only be enabled after you have completed your site. <br /><br /> Gzip must be installed on your server and enabled in PHP in order to function.</span></div>\r\n<br />\r\n<h3 class=\"s5_demo_h3\">Without Compression Enabled:</h3>\r\n<p><img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/compression_without.png\" border=\"0\" /></p>\r\n<h3 class=\"s5_demo_h3\">With Compression Enabled:</h3>\r\n<p><img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/compression_with.png\" border=\"0\" /></p>\r\n<p> </p>\r\n<div class=\"blue_box\"><strong>I like what I see! I want to <a href=\"http://www.shape5.com/join-now.html\" target=\"_top\">JOIN TODAY</a>.</strong></div>\r\n<p> </p>','',1,10,'2013-05-12 03:34:33',809,'','2014-08-09 14:27:08',42,0,'0000-00-00 00:00:00','2013-05-12 03:34:33','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',7,41,'','',1,540,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(4,43,'Fixed Side Tabs','fixed-side-tabs','This template includes a \"Fixed Tab\" option that you can enable and publish on your site and will show in a fixed position on either the left or right side of the screen. The great feature about the fixed tabs is that you can enter any text you desire and the text is automatically flipped vertically! This is great for search engines to read your text and also saves the hassle of creating an image with vertical text and placing it on the side of your site. The tabs are published site wide and can have the following options that can be changed via the template parameters area and can link to any URL that you desire.\r\n\r\n\r\n<br /><br /><h3 class=\"s5_demo_h3\">The following is a quick list of features: </h3></p>\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Change background to any hex color </li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Change the border to any hex color</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Change the font to any hex color</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set vertical position of each tab</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set the height of each tab</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set each tab to either the left or right of the screen</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Add a class to each fixed tab to enable s5 box or perhaps a lightbox or other 3rd party extension</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Add a URL to each fixed tab so onclick the URL loads</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Enter any text you desire</li>\r\n</ul>\r\n\r\n<br /><br />   <div class=\"blue_box\"><strong>I like what I see! I want to <a href=\"http://www.shape5.com/join-now.html\" target=\"_top\">JOIN TODAY</a>.</strong></div>','',1,10,'2013-05-12 03:35:29',809,'','2014-08-09 14:32:35',42,0,'0000-00-00 00:00:00','2013-05-12 03:35:29','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',5,40,'','',1,521,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(5,44,'Google Fonts Enabled','google-fonts-enabled','Do you want your own custom font? Not a problem, this template comes with Google Fonts enabled, allowing you to pick from hundreds of font families for your website. In the template parameters area of the template you can choose your own custom font, and preview it from the Vertex interface. Below are some examples of the fonts available.<br/><br/>\r\n\r\n<img alt=\"\" src=\"http://www.shape5.com/demo/images/general/google_fonts.png\"></img>\r\n\r\n<br />\r\n<br /><br />\r\n\r\n<div class=\"blue_box\"><strong>I like what I see! I want to <a href=\"http://www.shape5.com/join-now.html\" target=\"_top\">JOIN TODAY</a>.</strong></div><br /></ul>','',1,10,'2013-05-12 03:35:52',809,'','2014-08-09 14:29:53',42,0,'0000-00-00 00:00:00','2013-05-12 03:35:52','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',3,39,'','',1,537,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(6,45,'Hide Article Component Area','hide-article-component-area','Did you ever need to create a page where this is no article present or no component to be shown, and only load modules? This template makes it all possible! From the template configuration page you can hide the main content area on any page on the site. \r\n\r\n<br /><br />\r\n\r\nBelow is a screenshot of this function from the configuration page, found under the Main / Layout tab under the field \"Hide Component Output?\" in the middle of the screen:\r\n\r\n<br /><br />\r\n\r\n<img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/hide_articles.png\" alt=\"\"></img>\r\n\r\n<div style=\"clear:both; height:0px\"></div>','',1,10,'2013-05-12 03:36:11',809,'','2016-08-03 13:20:40',159,0,'0000-00-00 00:00:00','2013-05-12 03:36:11','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,38,'','',1,579,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(7,46,'Hide Divs, Content, and Modules','hide-divs-content-and-modules','One of the biggest obstacles to overcome when designing a responsive layout site is that not all content, images and extensions were designed to work with responsive layouts. That means that sometimes you need the ability to hide a specific element on only certain sized screens, so that something doesn\'t break the site\'s layout and everything looks proportionate. We\'ve made that all possible and very easy to do for you with hiding classes! There are three main ways to hide content on different size screens, and they are documented below. Please note that these classes are only enabled when the responsive layout is enabled.\r\n<br /><br />\r\n<div class=\"blue_box\">\r\n<a style=\"text-decoration:underline\" target=\"_blank\" href=\"http://www.shape5.com/documentation/Miscellaneous/Responsive-Best-Practices\">\r\nBe sure to visit our Knowledgebase for useful responsive layout tips.</a>\r\n</div>\r\n<br /><br />\r\n<h3 class=\"s5_demo_h3\">Hide Sections of the Template via the Template Configuration</h3>\r\nThis is the simplest way to hide an area of the template is to use the template interface to easily select areas of the template that you want to hide on tablet sized screens (970px and less) or mobile screens (580px or less). Simply select the area that you want to hide and the Vertex framework takes care of the rest! These fields do work independent of each other, so if you want to hide something on both tablet and mobile sized screens you must select the same area on both fields.\r\n<br /><br />\r\n<img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/hide_divs1.png\"></img>\r\n<br /><br />\r\nIMPORTANT - If you turn off a column position such as right or right_inset something else must be in the same column or the layout will not work. For example you can turn off right_inset and keep right, but you cannot turn off both unless something is publihsed to right_top or right_bottom as well.\r\n\r\n\r\n<br /><br />\r\n<h3 class=\"s5_demo_h3\">Hide Specific Modules via the Hide Classes</h3>\r\nIf you have only a specific module that you would like to hide at certain screen sizes, and not an entire section of the template, this is the best approach. A hide class is a class that can be applied to any element on the page and hides that particular element at certain screen sizes. Classes range in 100px increments for large screens and 50px increments for small screens. <strong>Below are some examples, and at the very bottom of this page there is a list of all the available hide classes.</strong> Use these sparingly if you can. As a recommendation, the primary target of these classes should focus on tablet and mobile sized screens. Wide screen monitors vary in size so it\'s much harder to use these classes correctly for large monitors. Tablet and mobile devices are much more consistent in size so it is much easier to apply the smaller hide classes.\r\n<br /><br />\r\nFor example, say you want to hide a specific module when the screen sizes reaches 900px wide, and remain hidden for any screen below 900px. Simply add class=hide_900 to the title of the module like this:\r\n<br /><br />\r\n<img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/hide_divs2.png\"></img>\r\n<br /><br />\r\nThe class is simply put into the title of the module. There must be a space just before class= , and don\'t worry, the class area of the title won\'t actually show on the live site, it\'s only shown in the backend. It must be entered exactly as shown above. The title can be published or unpublished, it does not matter which. Simply adding the classes to the title will apply the classes to the entire module.\r\n<br /><br />\r\nWhat if you want it to hide the module only for a certain range? That\'s easy just add _only to the end of the class name. hide_900_only will only hide that element from 900px to the next increment in the hide classes, which is 850px. So it will only be hidden from 850px to 900px. You can also add multiple classes to the title like this class=hide_900_only hide_850_only which will apply both classes to the module.\r\n<br /><br />\r\nWhat if you want to hide the module and then show it again later? That\'s simple, use show_ in the class instead of hide_. This will make the module show for the specified size no matter what other settings are on the module. So if you want to hide the module from 1000px and below, but you want to show it again later then do something like the following class=hide_1000 show_600. This will hide the module from 600px to 1000px.\r\n<br /><br />\r\nIs there a more simple way? Yes, of course, the above directions are for experienced users who want to tweak their content for every available screen size. If you don\'t want to mess around with specific window sizes simply use the following classes instead, which have preset screen sizes applied to them:\r\n<br /><br />\r\nhide_all<br />\r\nhide_wide_screen<br />\r\nhide_standard_screen<br />\r\nhide_large_tablet<br />\r\nhide_small_tablet<br />\r\nhide_mobile<br />\r\nshow_wide_screen<br />\r\nshow_standard_screen<br />\r\nshow_large_tablet<br />\r\nshow_small_tablet<br />\r\nshow_mobile<br />\r\n\r\n<br />\r\n\r\nWhy would someone use hide_all? This is a great tool for anyone wanting to show content only on a mobile or tablet sized screen but hide it on all other devices. To do this you should use class=\"hide_all show_mobile\". The hide_all will set the content or module to display:none on all devices, and one the screen size reaches mobile size the show_mobile will override the display:none and show the content.\r\n<br />\r\n<br />\r\n\r\n<br />\r\n<h3 class=\"s5_demo_h3\">Hide Specific Content via the Hide Classes</h3>\r\nIf you have only specific content or images within an article or module that you want to hide then use the same hide classes described above, but wrap that specific content inside of the class instead of applying it to the entire module. For example, in the image below, the third paragraph will hide at 900px and then show again at 700px.\r\n\r\n<br /><br />\r\n<img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/hide_divs3.png\"></img>\r\n<br /><br />\r\n\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Available Hide Classes</h3>\r\nAll the available hide classes are listed below. Note there is a break at 970px and 580px to accommodate tablet and mobile sized screens. At the bottom of the list you will see inline calls, these calls should only be used if the default block calls cause a layout problem with your content, which can happen with applying a display:block.\r\n<br><br>\r\n\r\n<p>/* HIDE CLASSES<br>\r\n----------------------------------------------------------- */<br>\r\n<br>\r\n@media screen and (max-width: 1600px){<br>\r\n.hide_1600 {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n} <br>\r\n<br>\r\n@media screen and (min-width:1500px) and (max-width: 1600px){<br>\r\n.hide_1600_only {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n}<br>\r\n<br>\r\n@media screen and (max-width: 1550px){<br>\r\n.hide_1550 {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n} <br>\r\n<br>\r\n@media screen and (min-width:1450px) and (max-width: 1550px){<br>\r\n.hide_1550_only {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n}<br>\r\n<br>\r\n@media screen and (max-width: 1500px){<br>\r\n.hide_1500 {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n} <br>\r\n<br>\r\n@media screen and (min-width:1400px) and (max-width: 1500px){<br>\r\n.hide_1500_only {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n}<br>\r\n<br>\r\n@media screen and (max-width: 1450px){<br>\r\n.hide_1450 {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n} <br>\r\n<br>\r\n@media screen and (min-width:1350px) and (max-width: 1450px){<br>\r\n.hide_1450_only {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n}<br>\r\n<br>\r\n@media screen and (max-width: 1400px){<br>\r\n.hide_1400 {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n} <br>\r\n<br>\r\n@media screen and (min-width:1300px) and (max-width: 1400px){<br>\r\n.hide_1400_only {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n}<br>\r\n<br>\r\n@media screen and (max-width: 1350px){<br>\r\n.hide_1350 {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n} <br>\r\n<br>\r\n@media screen and (min-width:1250px) and (max-width: 1350px){<br>\r\n.hide_1350_only {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n}<br>\r\n<br>\r\n@media screen and (max-width: 1300px){<br>\r\n.hide_1300 {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n} <br>\r\n<br>\r\n@media screen and (min-width:1200px) and (max-width: 1300px){<br>\r\n.hide_1300_only {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n}<br>\r\n<br>\r\n@media screen and (max-width: 1250px){<br>\r\n.hide_1250 {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n} <br>\r\n<br>\r\n@media screen and (min-width:1150px) and (max-width: 1250px){<br>\r\n.hide_1250_only {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n}<br>\r\n<br>\r\n@media screen and (max-width: 1200px){<br>\r\n.hide_1200 {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n} <br>\r\n<br>\r\n@media screen and (min-width:1100px) and (max-width: 1200px){<br>\r\n.hide_1200_only {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n}<br>\r\n<br>\r\n@media screen and (max-width: 1150px){<br>\r\n.hide_1150 {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n} <br>\r\n<br>\r\n@media screen and (min-width:1050px) and (max-width: 1150px){<br>\r\n.hide_1150_only {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n}<br>\r\n<br>\r\n@media screen and (max-width: 1100px){<br>\r\n.hide_1100 {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n} <br>\r\n<br>\r\n@media screen and (min-width:1000px) and (max-width: 1100px){<br>\r\n.hide_1100_only {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n}<br>\r\n<br>\r\n@media screen and (max-width: 1050px){<br>\r\n.hide_1050 {<br>\r\ndisplay:none !important;<br>\r\n}<br>\r\n} <br>\r\n<br>\r\n@media screen