(8,47,'How To Setup the Search Box and Menus','how-to-setup-the-search-box-and-menus','<h3 class=\"s5_demo_h3\">1. Search Setup</h3>\r\n<span style=\"font-size: medium;\"><strong> <img src=\"images/search.png\" class=\"padded\" /></strong></span>\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Simply publish a search module to the search position.</li>\r\n</ul>\r\n\r\n<br />\r\n\r\n<h3 class=\"s5_demo_h3\">2. Column Menu Setup</h3>\r\n<span style=\"font-size: medium;\"><strong> <img src=\"images/column_menu.png\" class=\"padded\" /></strong></span>\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Publish any menu module to the main body module positions on your site. </li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>There should be no menu style suffixes applied under advanced parameters.</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span> The menu style should be set to list.</li>\r\n</ul>\r\n\r\n\r\n\r\n<br />\r\n<h3 class=\"s5_demo_h3\">3. Bottom Menu Setup</h3>\r\n<img src=\"images/bottom_menu.png\" class=\"padded\" />\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Publish any menu to the &#39;bottom_menu&#39; position.</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span> There are no menu style suffixes applied under advanced parameters.</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span> The menu style should be set to list</li>\r\n</ul>\r\n ','',1,10,'2013-05-12 03:37:17',809,'','2016-08-05 20:25:29',159,0,'0000-00-00 00:00:00','2013-05-12 03:37:17','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"