(10,49,'Info Slide','info-slide','The info slide script is a great way to display your content to your customers! It will place a sliding text box over any image on the page. It can be placed inside of content or modules. It will also automatically adjust to any size screen size on window resize. See below for a demonstration. In the backend of Vertex you can pick between a javascript only version or a pure css version. \r\n\r\n\r\n<br /><br />\r\n<div class=\"blue_box\">\r\n<a style=\"text-decoration:underline\" target=\"_blank\" href=\"http://www.shape5.com/documentation/Core-Features/Info-Slide\">\r\nFor a tutorial on how to setup this script be sure to view our guide.</a>\r\n</div>\r\n\r\n<br /><br />\r\n\r\n<h3 class=\"s5_demo_h3\">Javascript Version </h3>\r\n<br />\r\n\r\n<div class=\"s5_is\" style=\"float:left; width:48%; margin-right:2%; margin-bottom:15px\">\r\n	<img alt=\"\" src=\"http://www.shape5.com/demo/images/general/lazyload/lazy_load1.jpg\"  class=\"likeme-disabled\"></img>\r\n	<div class=\"s5_is_slide\">\r\n	<h3>Example Slide</h3>\r\n	This is dummy text. You can add any text or html markup here.\r\n	</div>\r\n</div>\r\n\r\n<div class=\"s5_is\" style=\"float:left; width:48%; margin-left:2%; margin-bottom:15px\">\r\n	<img alt=\"\" src=\"http://www.shape5.com/demo/images/general/lazyload/lazy_load2.jpg\"  class=\"likeme-disabled\"></img>\r\n	<div class=\"s5_is_slide\">\r\n	<h3>Example Slide</h3>\r\n	This is dummy text. You can add any text or html markup here.\r\n	</div>\r\n</div>\r\n<div style=\"clear:both\"></div>\r\n\r\n<br /><br />\r\n<h3 class=\"s5_demo_h3\">CSS Version Default</h3>\r\n<br />\r\n\r\n\r\n\r\n<div class=\"s5_is_css\" style=\"float:left; width:48%; margin-right:2%; margin-bottom:15px\">\r\n	<img alt=\"\" src=\"http://www.shape5.com/demo/images/general/lazyload/lazy_load4.jpg\"  class=\"likeme-disabled\"></img>\r\n	<div class=\"s5_is_slide_css\">\r\n	<h3>Example Slide</h3>\r\n        <div class=\"s5_is_css_hidden\">\r\n	  This is dum