(11,50,'Installing The Template','installing-the-template','<br /><ul class=\"ul_circle_content\"><li><span class=\"circle_item\">01</span>Download the installation package from our download section.</li><li><span class=\"circle_item\">02</span>Once the download is complete go to the backend of Joomla.</li><li><span class=\"circle_item\">03</span>Navigate through your menu system to Extensions/Extensions Manager.</li>\r\n\r\n\r\n<img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/install_menu.png\" />\r\n<li><span class=\"circle_item\">04</span>Once at the installation screen click the browse button and navigate to where you downloaded the template file.</li>     <li><span class=\"circle_item\">05</span>Once you have the file selected click &#39;Upload File and Install&#39;</li>     \r\n  <p>\r\n  <img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/browse.png\" /></p>\r\n  <p><b>The template is now installed, now let&#39;s set it as the default template:</b><br />     </p>     <li><span class=\"circle_item\">06</span>Navigate through your menu system to Extensions/Template Manager.</li><li><span class=\"circle_item\">07</span>Find the radio button next to the newly installed template.</li><li><span class=\"circle_item\">08</span>Click on the Default button at the top right of the screen and you&#39;re done!</li><p>\r\n  <img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/default.png\" /></ul>   ','',1,10,'2013-05-12 03:38:31',809,'','2014-08-09 14:44:24',42,0,'0000-00-00 00:00:00','2013-05-12 03:38:31','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_title