(12,51,'Lazy Load Images','lazy-load-images','The lazy load script is a great way to save bandwidth and load your pages much faster. Images that are not visible on the initial page load are not loaded or downloaded until they come into the main viewing area. Once an image comes into view it is then downloaded and faded into visibility. Scroll down this page to see the script in action.\r\n\r\n<br /><br />\r\n\r\nSetup is very easy! By default this script is disabled, in order to enable it simply choose All Images or Individual Images from the drop down, as shown below from inside the template configuration page.\r\n\r\n<br /><br />\r\n\r\n<img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/lazy_load.png\" alt=\"\"></img>\r\n\r\n<br /><br />\r\n\r\nAll images will load every standard image on the page with lazy load. There is no extra configuration or extra code to add with this configuration, it will just happen automatically. Individual images would be used if you want only certain images to load with this script and not all of them. To do this simply add class=\"s5_lazyload\" to the image like so:\r\n\r\n<br />\r\n\r\n<div class=\"code\">\r\n\r\n&lt;img class=&quot;s5_lazyload&quot; src=&quot;http://www.yoursite.com/image.jpg&quot;&gt;&lt;/img&gt;\r\n\r\n</div>\r\n\r\n<br /><br />\r\nThis script is compatible with Firefox3+, IE8+, Chrome14+, Safari5.05+, Opera 11.11+\r\n<br /><br />\r\n<h3 class=\"s5_demo_h3\">See the script in action:</h3>\r\n<br />\r\n\r\n<img src=\"http://www.shape5.com/demo/images/general/lazyload/lazy_load1.jpg\" alt=\"\" class=\"s5_lazyload padded\"></img>\r\n<img src=\"http://www.shape5.com/demo/images/general/lazyload/lazy_load2.jpg\" alt=\"\" class=\"s5_lazyload padded\"></img>\r\n<img src=\"http://www.shape5.com/demo/images/general/lazyload/lazy_load3.jpg\" alt=\"\" class=\"s5_lazyload padded\"></img>\r\n<img src=\"http://www.shape5.com/demo/images/general/lazyload/lazy_load4.jpg\" alt=\"\" class=\"s5_lazyload padded\"></img>\r\n<img src=\"http://www.shape5.com/demo/images/general/lazyload/lazy_load5.jpg\" alt=\"\" class=\"s5_lazyload padded\"></img>\r\n<img src=\"http://www.shape5.com/demo/images/general/lazyload/lazy_load6.jpg\" alt=\"\" class=\"s5_lazyload padded\"></img>\r\n<img src=\"http://www.shape5.com/demo/images/general/lazyload/lazy_load7.jpg\" alt=\"\" class=\"s5_lazyload padded\"></img>\r\n<img src=\"http://www.shape5.com/demo/images/general/lazyload/lazy_load8.jpg\" alt=\"\" class=\"s5_lazyload padded\"></img>\r\n<img src=\"http://www.shape5.com/demo/images/general/lazyload/lazy_load9.jpg\" alt=\"\" class=\"s5_lazyload padded\"></img>\r\n<img src=\"http://www.shape5.com/demo/images/general/lazyload/lazy_load10.jpg\" alt=\"\" class=\"s5_lazyload padded\"></img>','',1,10,'2013-05-12 03:38:57',809,'','2014-04-15 14:37:20',42,0,'0000-00-00 00:00:00','2013-05-12 03:38:57','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',3,33,'','',1,533,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(13,52,'Login and Register Setup','login-and-register-setup','<p>The S5 Box can be demo&#39;d by clicking on either the Login button on this page.  <br /> <br /> The module allows for up to 10 different S5 Box&#39;s on one page all via 10 module  positions. You simply add a class to any HTML element on your site and enable  the corresponding box and you are good to go!</p>\r\n<br />\r\n<h3 class=\"s5_demo_h3\">To enable the login and register modules:</h3>\r\n\r\n\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\">01</span>Install the S5 Box module and publish it to all pages on your site. Try  to publish it to a position where a module already exists on all pages, but  don&#39;t worry it won&#39;t change the layout of your site, the script is automatically  hidden on your site.</li>\r\n<li><span class=\"circle_item\">02</span>Install and publish the S5 Register module to the &#39;register&#39; module  position</li>\r\n<li><span class=\"circle_item\">03</span>Publish the default Joomla login module to the &#39;login&#39; module position.</li>\r\n<li><span class=\"circle_item\">04</span>In your template parameters area of Joomla you can change the text for login, register and logout.</li>\r\n<li><span class=\"circle_item\">05</span>That&#39;s it, you&#39;re all done!</li>\r\n</ul>\r\n\r\n\r\n\r\n<br />\r\n\r\n<strong>\r\nIf you do not wish to use the S5 Box but would still like to use the Login and Register links then simply complete step 4 above and also fill out your own custom urls just below those fields in the template configuration. Filling out the custom url fields will disable the S5 Box.\r\n</strong>\r\n\r\n\r\n<p>The S5 Box runs off of the core Joomla jquery/mootools libraries so there will be no conflicts with third party extensions or extra javascript files to download.<br /><br /> <h3 class=\"s5_demo_h3\">Features:</h3>\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Powered by no conflict mode jQuery Javascript or mootools</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Choose, elastic, fade or none for the popup effect</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Up to 10 S5 Box&#39;s throughout your site or on any one page!</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set the percentage of width of each box according to overall screen size</li>\r\n</ul>\r\n<br />\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Tutorial on how to get the s5 box working and use all 10 module positions it includes:</h3>\r\n\r\n\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\">01</span>Adding the S5 Box positions:</li>\r\n</ul>\r\n\r\n\r\n<ul>\r\n<li>Open up the templateDetails.xml file included with the template you are using.</li>\r\n<li>Locate the positions area.</li>\r\n<li>Start adding new positions s5_box1, s5_box2, s5_box3, etc all the way up to s5_box10.</li>\r\n</ul>\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\">02</span>Adding the S5 Box classes:</li>\r\n</ul>\r\n<ul>\r\n<li>The S5 Box class name of the corresponding position must be added to the link that will open the box. For example the following code will display a link that says Click Here and will open the S5 Box and display whatever module is published to the s5_box3 module position: <br /><br /> <img src=\"http://www.shape5.com/demo/get_reserved/images/box_link.png\" border=\"0\" /> <br /><br /> </li>\r\n<li>These classes can be added to any element, ie: divs, spans, etc., but the common use will be to add this into content with a link similar to the one shown in the picture above. To enter this link you must do so from the HTML edit screen on your content editor:  <br /><br /> Once you have clicked the HTML button the HTML code window will appear much like the first image. </li>\r\n<li>You can continue adding these classes throughout your site just be sure to have published a module to the corresponding position or the box will not work correctly. So if you add the class s5box_two you will also have to publish a module to the s5_box2 position.</li>\r\n<li> Module positions and their corresponding classes:<br /><br /> s5_box1 = s5box_one<br /> s5_box2 = s5box_two<br /> s5_box3 = s5box_three<br /> s5_box4 = s5box_four<br /> s5_box5 = s5box_five<br /> s5_box6 = s5box_six<br /> s5_box7 = s5box_seven<br /> s5_box8 = s5box_eight<br /> s5_box9 = s5box_nine<br /> s5_box10 = s5box_ten</li>\r\n</ul>\r\n\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\">03</span>Lastly, publish your modules to the S5 Box positions:</li>\r\n</ul>\r\n\r\n<ul>\r\n<li>Now that you have added the s5 box positions just go to your site modules area and publish modules to those positions</li>\r\n<li>Make sure that you have added a class to an HTML element as described above or the s5 box will have no activation button </li>\r\n<li>Also make sure to publish the actual s5 box to a non s5 box position, perhaps publish it to the \"debug\" position or a similar one in your template.</li>\r\n</ul>\r\n<br /> <h3 class=\"s5_demo_h3\">Main S5 Box Module Settings:</h3>\r\n<ul>\r\n<li>In the backend of the S5 Box module you can adjust the width of each box independent of each other. </li>\r\n<li>Make sure that the S5 Box module is published to all pages, it can be published to any template position. Also make sure that the module opening in the box is published to the page the link is on. </li>\r\n</ul>\r\n<br />','',1,10,'2013-05-12 03:39:20',809,'','2017-04-06 18:23:35',832,0,'0000-00-00 00:00:00','2013-05-12 03:39:20','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',11,32,'','',1,688,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(14,53,'Menu Scroll To Section','menu-scroll-to-section','This template includes a scroll to feature that will scroll your page to a specified section of your site. All you have to do is create an external link in your menu manager and then in the URL area enter in any ID on your page. You can reference any of the following IDs in order:<br /><br />\r\n\r\n<ul class=\"ul_bullet_small\">\r\n<li>#s5_header_area1</li>\r\n<li>#s5_top_row1_area1</li>\r\n<li>#s5_top_row2_area1</li>\r\n<li>#s5_top_row3_area1</li>\r\n<li>#s5_center_area1</li>\r\n<li>#s5_bottom_row1_area1</li>\r\n<li>#s5_bottom_row2_area1</li>\r\n<li>#s5_bottom_row3_area1</li>\r\n<li>#s5_footer_area1</li>\r\n\r\n</ul>\r\n<br />\r\nScreenshot of admin area of an external menu item with DIV reference entered:<br /><br />\r\n\r\n<img border=\"0\" src=\"http://www.shape5.com/demo/images/general/scrollto.jpg\" style=\"\">','',1,10,'2013-05-12 03:39:46',809,'','2013-06-11 15:53:23',516,0,'0000-00-00 00:00:00','2013-05-12 03:39:46','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,31,'','',1,523,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(15,54,'Module Positions and Styles','module-positions-and-styles','<div class=\"blue_box\"><a style=\"text-decoration: underline;\" href=\"features-mainmenu-47/template-features/responsive-layout\"> Be sure to check out the responsive layout page to see how the layout below is constructed on multiple screen sizes</a></div>\r\n<br />\r\n<h3 class=\"s5_demo_h3\">All modules are fully collapsible</h3>\r\nWhat exactly is a collapsing module? It\'s quite simple, whenever a module is not published to a postion that position does not appear on the frontend of the template. Consider the example below: <br /><br /> <img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/modules_6.png\" /> <br /><br /> This particular row has 6 module positions available to publish to. Let\'s say you only want to publish to 4 of these positions. The template will automatically collapse the modules you do not want to use and adjust the size of the modules accordingly: <br /><br /> <img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/modules_4.png\" /> <br /><br /> If no modules are published to the row the entire row itself will not show. The best feature of this is every module can be published to its own unique pages so the layout of your site can change on every page! <br /><br /><br />\r\n<h3 class=\"s5_demo_h3\">Infinite Layouts</h3>\r\nBecause there are so many module positions available in so many different areas, the number of layouts you can create are limitless! For example, if you would like to show your main content area on the right side of your site but still have a column of modules, simply published your modules to the right or right_inset positions or both. The same would be true for the opposite, if you want a column on the left simply publish modules to left or left_inset. Of course you can always choose to not have a column at all. Remember, any module not published to will automatically collapse and the remaining area will automatically adjust. There is no need to choose a pre-defined layout for your entire site, simply use the power of collpasing module positions and take advantage of the numerous amount of module positions to create any layout you can dream of! Be sure to checkout the layout of modules below. <br /><br /><br />\r\n<h3 class=\"s5_demo_h3\">Dozens of Modules</h3>\r\nBelow is a complete list of all the module positions available for this template. <br /><br /> <img class=\"padded\" src=\"http://www.shape5.com/images/products/2017/outdoor_life/module_positions.png\" /> <br /><br />\r\n<h3 class=\"s5_demo_h3\">How to install and setup module styles:</h3>\r\n<ul class=\"ul_circle_content\">\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\">01</span> Download any module you wish to publish to your site.</li>\r\n<li><span class=\"circle_item\">02</span>In the backend of Joomla navigate to the menu item Extensions/Install Uninstall</li>\r\n</ul>\r\n</ul>\r\n<br /><img class=\"padded\" style=\"margin-bottom: 14px;\" src=\"http://www.shape5.com/demo/images/general/install_menu.png\" border=\"0\" height=\"172\" width=\"199\" /><br />\r\n<ul class=\"ul_circle_content\">\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\">03</span>Browse for the module\'s install file and click Upload File &amp; Install.</li>\r\n<li><span class=\"circle_item\">04</span> Once the module has be installed navigate to the menu item Extensions/Module Manager (same menu as above)</li>\r\n<li><span class=\"circle_item\">05</span>Find the Module just installed and click on it\'s title.</li>\r\n<li><span class=\"circle_item\">06</span> Change any parameters that you wish and be sure to set it to published and publish it to your desired module position.</li>\r\n<li><span class=\"circle_item\">07</span>To apply a module style simply fill in the module class suffix field with any of this template\'s included module styles. This parameter setting is found under Module Parameters on the right side of the screen.</li>\r\n</ul>\r\n</ul>\r\n<br /><img class=\"padded\" style=\"margin-bottom: 14px;\" src=\"http://www.shape5.com/demo/images/general/module_suffix.png\" border=\"0\" height=\"72\" width=\"200\" /><br />\r\n<ul class=\"ul_circle_content\">\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\">08</span>Assign what pages you would like the module to appear on and finally click Save.</li>\r\n</ul>\r\n</ul>\r\n<br /><img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/page_assignment.png\" border=\"0\" height=\"144\" width=\"200\" />','',1,10,'2013-05-12 03:40:20',809,'','2017-01-06 00:49:14',911,0,'0000-00-00 00:00:00','2013-05-12 03:40:20','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',56,30,'','',1,2310,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(16,55,'Multibox','multibox','<br/>\r\n\r\n<div class=\"blue_box\">\r\n<a target=\"_blank\" href=\"http://www.shape5.com/documentation/Core-Features/Javascript-Effects\">\r\nFor a tutorial on how to setup this script be sure to view our guide.</a>\r\n</div>\r\n\r\n\r\n<br/><h3 class=\"s5_demo_h3\">Features:</h3>\r\n\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Supports a range of multimedia formats: images, flash, video, mp3s, html!</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Auto detects formats or you can specify the format</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Html descriptions</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Enable/Disable page overlay when multibox pops up (via template parameters)</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Enable/Disable controls (via template parameters)</li>\r\n</ul>\r\n\r\n\r\n\r\n<br/>\r\n\r\n\r\n\r\n<p><h3 class=\"s5_demo_h3\">Images Example</h3></p>          \r\n<a href=\"http://www.shape5.com/demo/images/multibox1_lrg.jpg\" id=\"mb1\" class=\"s5mb\" title=\"Image #1:\">\r\n<img src=\"http://www.shape5.com/demo/images/multibox1.jpg\" style=\"margin-right:20px\" class=\"boxed likeme-disabled\" alt=\"\" />\r\n</a>\r\n<div class=\"s5_multibox mb1\">Image #1. It can support <strong>html</strong>.</div>\r\n&nbsp;&nbsp;\r\n<a href=\"http://www.shape5.com/demo/images/multibox2_lrg.jpg\" id=\"mb2\" class=\"s5mb\" title=\"Image #2:\">\r\n<img src=\"http://www.shape5.com/demo/images/multibox2.jpg\" style=\"margin-right:20px\" class=\"boxed likeme-disabled\" alt=\"\" />\r\n</a>\r\n<div class=\"s5_multibox mb2\">Image #2. It can support <strong>html</strong>.</div>\r\n&nbsp;&nbsp;\r\n<a href=\"http://www.shape5.com/demo/images/multibox3_lrg.jpg\" id=\"mb3\" class=\"s5mb\" title=\"Image #3:\">\r\n<img src=\"http://www.shape5.com/demo/images/multibox3.jpg\" class=\"boxed likeme-disabled\" alt=\"\" />\r\n</a>\r\n<div class=\"s5_multibox mb3\">Image #3. It can support <strong>html</strong>.</div>\r\n<br><br>\r\n\r\n\r\n<div style=\"clear:both\"></div>\r\n\r\n\r\n<p><h3 class=\"s5_demo_h3\">Separate Group Images Example</h3></p>          \r\n\r\n<a href=\"http://www.shape5.com/demo/images/multibox1_lrg.jpg\" rel=\"[group1]\" id=\"mb9\" class=\"s5mb\" title=\"Image #1:\">\r\n<img src=\"http://www.shape5.com/demo/images/multibox1.jpg\" style=\"margin-right:20px\" class=\"boxed likeme-disabled\" alt=\"\" />\r\n</a>\r\n<div class=\"s5_multibox mb9\">Image #1. It can support <strong>html</strong>.</div>\r\n&nbsp;&nbsp;\r\n<a href=\"http://www.shape5.com/demo/images/multibox2_lrg.jpg\" rel=\"[group1]\" id=\"mb10\" class=\"s5mb\" title=\"Image #2:\">\r\n<img src=\"http://www.shape5.com/demo/images/multibox2.jpg\" style=\"margin-right:20px\" class=\"boxed likeme-disabled\" alt=\"\" />\r\n</a>\r\n<div class=\"s5_multibox mb10\">Image #2. It can support <strong>html</strong>.</div>\r\n&nbsp;&nbsp;\r\n<a href=\"http://www.shape5.com/demo/images/multibox3_lrg.jpg\" rel=\"[group1]\" id=\"mb11\" class=\"s5mb\" title=\"Image #3:\">\r\n<img src=\"http://www.shape5.com/demo/images/multibox3.jpg\" class=\"boxed likeme-disabled\" alt=\"\" />\r\n</a>\r\n<div class=\"s5_multibox mb11\">Image #3. It can support <strong>html</strong>.</div>\r\n\r\n<br><br>\r\n\r\n<div style=\"clear:both\"></div>\r\n\r\n\r\n\r\n\r\n\r\n<p><h3 class=\"s5_demo_h3\">Video Example:</h3></p>   \r\n\r\n<a href=\"http://www.youtube.com/embed/VGiGHQeOqII\" id=\"youtube\" class=\"s5mb\" title=\"Youtube.com Video\">\r\nYoutube.com Video - CLICK ME\r\n</a>\r\n<div class=\"s5_multibox youtube\">UP: Carl and Ellie </div>\r\n\r\n<br/>\r\n<br/>\r\nYou can use the following video formats: flv, mov, wmv, real and swf.  Just insert the URL to the videos in the href of the hyperlink, here is an example of how we did this for a Youtube video:<br/>\r\n\r\n\r\n\r\n<br/>\r\nYouTube Tutorial:  Simply right click on a youtube video and copy the embed code, then paste into a text editor and look for the embed src and use that URL in your hyperlink.\r\n\r\n\r\n<br>\r\n\r\n<br/><br/>\r\n\r\n\r\n<p><h3 class=\"s5_demo_h3\">MP3 Example:</h3></p>   \r\n\r\n\r\n<a href=\"http://www.shape5.com/demo/images/music.mp3\"  id=\"mb8\" class=\"s5mb\" title=\"Music\">MP3 example - CLICK ME</a>\r\n<div class=\"s5_multibox mb8\">mp3 example</div><br />\r\n\r\n\r\n\r\n<br>\r\n<br/>\r\n\r\n\r\n<p><h3 class=\"s5_demo_h3\">iFrame:</h3></p>   \r\n\r\n<a href=\"http://www.getfirebug.com\" rel=\"width:790,height:600,[iframe]\" id=\"mb28\" class=\"s5mb\" title=\"getfirebug.com\">iFrame/HTML Example - CLICK ME</a>\r\n<div class=\"s5_multibox mb28\">getfirebug.com</div><br />\r\n\r\n<br>\r\n\r\n\r\n<br/><br/>\r\n\r\n\r\n\r\n\r\n\r\n \r\n\r\n\r\n<div class=\"blue_box\">\r\nI like what I see! I want to <a href=\"http://www.shape5.com/join-now.html\" target=\"_top\"><strong>JOIN TODAY</strong></a>. </div>\r\n <br />','',1,10,'2013-05-12 03:40:47',809,'','2016-03-11 02:29:06',384,0,'0000-00-00 00:00:00','2013-05-12 03:40:47','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',49,29,'','',1,683,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(17,56,'Page, Column and Row Widths','page-column-and-row-widths','<br />\r\n<h3 class=\"s5_demo_h3\">Fixed or Fluid Width</h3>\r\nThis template has the ability to set the entire width of your set to either a \r\nfixed pixel width or a fluid percentage width. You can set the width to any size \r\nyou want.\r\n\r\n<br /><br />\r\n\r\n\r\n<div class=\"blue_box\">\r\n<a style=\"text-decoration:underline\" href=\"index.php/features-mainmenu-47/template-features/responsive-layout\">\r\nBe sure to check out the responsive layout page to see how the layout below is constructed on multiple screen sizes. The responsive layout will work with both fixed or fluid settings. Responsive layouts are completely optional.</a>\r\n</div>\r\n<br />\r\n\r\n<br /><h3 class=\"s5_demo_h3\">Column Widths</h3>\r\nYou may also set the widths of the following positions to any width that you \r\nneed to: left, left_inset, right, and right_inset. You may set them to any width \r\nyou need to. Columns can either be set to a fixed px width or they can be set to a fluid percentage width. If you are enabling the responsive layout we recommend setting these to percentage width.\r\n<br />\r\n<br /><br /><h3 class=\"s5_demo_h3\">Row Widths</h3>\r\nThis template comes loaded with module positions, many of which appear in rows \r\nof 6 module positions. Any row that contains 6 module positions can have it&#39;s \r\nrow columns set to automatic widths or manual. For example, in the picture below \r\nthe first row shows 4 modules published and since it&#39;s set to automatic each is \r\nset to 25% width. The second row shows a manual calculation for each module in \r\nthe row. Again, you may do this for any row that contains 6 modules. If you \r\nsetup a manual calculation they must total to 100%. Not all 6 modules need to be \r\nused, as shown below.<p>\r\n</p>\r\n<p>All of this is done very easily in the template configuration.</p>\r\n<p align=\"center\"><br />\r\n<img style=\"border:solid 1px #333333\" src=\"http://www.shape5.com/demo/images/general/custom_widths.png\" width=\"600\" height=\"432\" /></p>\r\n<br />','',1,10,'2013-05-12 03:41:17',809,'','2014-08-09 14:30:26',42,0,'0000-00-00 00:00:00','2013-05-12 03:41:17','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,28,'','',1,547,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(18,57,'Responsive Layout','responsive-layout','Responsive design at its most elementary definition is simply the use of css media queries and some javascript to rearrange a website\'s layout to fit multiple screen sizes. This can range from a wide screen monitor down to the smallest of smart phones. It is done all through the same site, same installation, sharing the same files, and no extra layouts needed as in the past. Unlike many pixel grid based templates, Shape5 Vertex templates are already built on a fluid width layout based on percentages, with an optional pixel width wrapper, which is what responsive layouts require. Because of this Vertex templates do not require a responsive layout, instead it is completely optional! That\'s right, if you\'re uncomfortable with responsive layouts or it won\'t work with your site, then simply turn it off and use the standard fixed or fluid width layout instead!\r\n<br /><br />\r\n<div class=\"blue_box\">\r\n<a style=\"text-decoration:underline\" target=\"_blank\" href=\"http://www.shape5.com/documentation/Miscellaneous/Responsive-Best-Practices\">\r\nBe sure to visit our Knowledgebase for useful responsive layout tips.</a>\r\n</div>\r\n<br />\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">What Makes The Vertex Responsive Layout The Best and Most Flexible?</h3>\r\n<ul>\r\n<li>The responsive layout is completely optional, don\'t use it if you don\'t want it!</li>\r\n<li>Virtually no javascript. The only javascript used is for the mobile bar effects and to add responsive capabilites to IE7. We believe that javascript should only be used as a last resort.</li>\r\n<li>Start with a fixed or fluid layout.</li>\r\n<li>Every area of the template, ie: columns, row, and body; can be set to a fluid layout.</li>\r\n<li>Automatic onclick menu functionality for small touch screens.</li>\r\n<li>Optional IE7/8 responsive layout.</li>\r\n<li>Very easy to understand layout, which allows you to setup your site with very little effort.</li>\r\n<li>Fully customizable mobile bar styling.</li>\r\n<li>Optional row re-distribution at smaller screens.</li>\r\n<li>Hide divs, modules and content easily with hide classes at specified screen sizes.</li>\r\n<li>Wide screen support options.</li>\r\n<li>Multiple options for fluid width images.</li>\r\n<li>And much more!</li>\r\n</ul>\r\n<br />\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Easy To Understand Layout</h3>\r\nOne of the biggest advantages to the Vertex Responsive Layout is that we start the layout as if it were designed for a desktop viewer, and then simply reduce, modify, or remove certain sections or font sizes based on the size of the user\'s screen. This is all done through css media queries, and is all done automatically for you! \r\n<br /><br />\r\nThe best way to see this approach, is simply resize your browser to see it all take effect.\r\n<br /><br />\r\nSome responsive designs simply use a series of floating divs that re-arrange themselves on the page and add columns as the screen width increases or decreases. The biggest con to this approach is it can become very confusing as to where your content will actually exist on any given screen; making it very hard to create a specific layout and confusing for a client; especially those with specific product and content placement needs. \r\n<br /><br />\r\nOur approach is much easier to understand. The site will always keep its core layout shown <a href=\"index.php/features-mainmenu-47/template-features/95-module-positions\">here</a>. When the screen changes it will adjust as described below. The majority of rows and columns will not change their basic styling or positions until they reach the mobile version. Again, only minor adjustments are made on varying screen sizes so that you always know what your site will look like and where content will be placed!<br /><br />\r\n<ul>\r\n<li>If the columns are set to use fluid widths then no changes will occur for large screens, everything will simply be percentage widths based on the availalbe area. If you are using the max-body width calculations the column widths will be based off of this setting instead of screen width.</li>\r\n<li>Between 1050px and 600px if you have set the columns to fluid widths, you have an option to combine the inset columns, if they are shown on the page, into a single column with their adjacent column. In other words right_inset and right become one column to save space. Because each site is different, you can choose the screen size to specify this change.\r\n<li>At 580px (a standard mobile device size) the entire body will become one single column and module stack on top of each other. Some adjustments to the header and footer will occur.</li>\r\n<li>Please note - you have an option to use either fluid or fixed width columns (right_inset, right, left_inset, and left). We highly recommend using fluid columns when responsive is enabled. If you choose fixed widths there are other responsive options available for this setting as well in the template configuration under the Layout tab.\r\n</ul>\r\n<br />\r\n\r\nBelow are illustrations of the center columns only in the scenarios described above.\r\n<br /><br />\r\n\r\n\r\n<img class=\"padded\" alt=\"\" src=\"http://www.shape5.com/demo/images/general/responsive_columns.png\"></img>\r\n\r\n<br /><br />\r\n\r\n<h3 class=\"s5_demo_h3\">Row Re-Distribution</h3>\r\nEach row in a Vertex template contains six module positions. If you are using a lot of modules in a particular row the content can become squished when the screen becomes too narrow, specifically on smaller seven inch tablet screens. The row re-distribution features allow you to change the layout into multiple rows with new module widths to give each position more room at specific screen sizes. You get to specify the screen width that this change will trigger at, and you can specify from several preset width options for each row indepent of each other. Single Column will set all modules in that row to 100% and one module per row. Two Columns will set all modules in that row to 50% and two modules per row. Three Columns will set all modules in that row to 33.33% and three modules per row. Redis. 33/50 will set positions 1 through 3 to 33.33% and positions 4 through 6 to 50%, this setting is meant to be used when positions 1 through 5 are in use. Redis. 50/100 will set positions 1 through 2 to 50% and positions 3 through 6 to 100%. Redis. 100/33 will set position 1 to 100% and positions 2 through 6 to 33.33%. Redis. 100/50 will set position 1 to 100% and positions 2 through 6 to 50%. This setting will override any custom row widths you set under the Row Sizes tab when the screen size reaches the selected width. All modules will always change to a single column at 580px for mobile view. This feature is NOT available for IE7 or IE8!\r\n<br /><br />\r\n\r\n\r\n\r\nBelow you will find a screenshot of the responsive options available in the Vertex framework. Below that you will find documentation for each feature shown.\r\n<br /><br />\r\n<img class=\"padded\" alt=\"\" src=\"http://www.shape5.com/demo/images/general/responsive1.png\"></img>\r\n<br /><br />\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">General Layout</h3>\r\nThe general layout options are the ones starting with Enable Font Resizer? and ending with Right Inset Width. These parameters are the core layout options that apply to all templates, whether responsive is enabled or not. Configuring this area is the first step in configuring a responsive layout. You can choose to set the site to either a fixed pixel width or fluid percentage width, the responsive layout will work with either option. If you are using the fluid width option we recommend enabling the Max Body Width option so that that your site does not go above the set pixels; this helps keep your site looking proportionate across very wide screen.\r\n<br /><br />\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Enable The Responsive Layout</h3>\r\nIf you wish to use the responsive layout simply turn on the switch and the Vertex framework will take care of the rest! It\'s really that simple! Notice there is a separate switch for IE7 and IE8. This browser does not support css media queries natively, which is what makes responsive layouts possible. In order to add this functionality the template must use javascript, which can affect the performance of a website. With this added javascript IE7 and IE8 will support the responsive layout, but we highly recommend leaving it turned off. Keep in mind that the primary target for responsive websites is tablet and mobile devices, where IE7 and IE8 do not exist. Please also note that some features such as the row re-distribution functions are not supported by IE7/8.\r\n<br /><br />\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Hide Tablet and Mobile Divs</h3>\r\nOne of the biggest obstacles to overcome when designing a responsive layout site is that not all content, images and extensions were designed to work with responsive layouts. That means that sometimes you need the ability to hide a specific element on only certain sized screens, so that something doesn\'t break the site\'s layout and everything looks proportionate. We\'ve made that all possible and very easy to do for you with hiding classes! There are three main ways to hide content on different size screens, and they are documented <a href=\"index.php/features-mainmenu-47/template-features/hide-content-and-modules\">here</a>.\r\n<br /><br />\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Column Settings</h3>\r\nDepnding on whether you have set the side columns to fixed or fluid widths, you have several options to choose from. We do highly recommend fluid columns when responsive is enabled. The first option, which pertains to both fixed and fluid, allows you to combine articles, will set modules published to middle_top and middle_bottom positions as well as articles published to the component area to a single column at the chosen screen width, this setting effects only those areas and nothing else. The settings below that are split into two sections depending on your column width setting. These settings effect combining the inset columns, creating a single column, and reducing the column widths. Be sure to read the tooltip of each section for a full description.\r\n<br /><br />\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Mobile Bars</h3>\r\nWhen the screen size reaches 750px wide (anything smaller than a standard 10 inch tablet), a navigation bar will appear across the top of the site and the bottom. This bar replaces the main menu, login, register, and search, for easier user on mobile devices. In the configuration you can choose what to enable on these bars as well as change the colors and style however you would like.\r\n<br /><br />\r\n<img class=\"padded\" alt=\"\" src=\"http://www.shape5.com/demo/images/general/responsive2.jpg\"></img>\r\n<br /><br />\r\n<img class=\"padded\" alt=\"\" src=\"http://www.shape5.com/demo/images/general/responsive3.jpg\"></img>\r\n<br /><br />\r\nThere are two layout options you can pick from: 1. A drop down layout where each item appears in an independent drop down that slides from the top of the site. 2. A off canvas sidebar option, where all items fit into a nice side slide-out area on the side of the site.\r\n<br /><br />\r\n<img class=\"padded\" alt=\"\" src=\"http://www.shape5.com/demo/images/general/responsive4.png\"></img>\r\n<br /><br />\r\n<img class=\"padded\" alt=\"\" src=\"http://www.shape5.com/demo/images/general/responsive5.png\"></img>\r\n<br /><br />\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Mobile Links</h3>\r\nEven though this is a responsive layout and there is no separate layout page for mobile devices, that does not mean that your site\'s viewers will understand this or even know what a responsive layout is. It has become a standard for websites that use a mobile layout to have a link to view the desktop view of the website, and this is what your site viewers will expect to see. This link simply turns off the responsive configuration using a cookie and calls the website like a standard desktop would when viewing in mobile. There is then a link to return back to the mobile view of the site presented.\r\n<br /><br />\r\n\r\n\r\n<div class=\"blue_box\">\r\nI like what I see! I want to <a href=\"http://www.shape5.com/join-now.html\" target=\"_top\"><strong>JOIN TODAY</strong></a>. </div>','',1,10,'2013-05-12 03:41:33',809,'','2015-04-08 20:24:36',956,0,'0000-00-00 00:00:00','2013-05-12 03:41:33','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',23,27,'','',1,1037,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(19,58,'S5 Accordion Menu','s5-accordion-menu','The S5 Accordion menu is demo&#39;d on this page. The styling of the module shown here is customized specifically for this template with css overrides, and cannot be used with any other template. The same module can be used on any template, but with default or other styling in its place.<br /><br />   \r\nThe accordion can be opened or closed by default on page load. This is configured in the backend configuration.\r\n<br /><br />   \r\nThis module is based off the Joomla main menu system module so you can still specify which Joomla menu you want to use with the S5 Accordion menu. The menu is powered off of the default mootools/jquery calls that are built directly into Joomla to avoid any javascript conflicts.\r\n\r\n\r\n\r\n<br /><br />   <div class=\"blue_box\"><strong>I like what I see! I want to <a href=\"http://www.shape5.com/join-now.html\" target=\"_top\">JOIN TODAY</a>.</strong></div>','',1,10,'2013-05-12 03:41:46',809,'','2015-10-12 20:06:38',436,0,'0000-00-00 00:00:00','2013-05-12 03:41:46','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',15,26,'','',1,1444,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(20,59,'Drop Down Panel','drop-down-panel','The S5 Drop Down Panel is a slide down panel that can be demo&#39;d at the top of this page. The panel itself contains six module positions. You may publish any module that you wish into these positions. It comes packed with features so be sure to check out the list and screenshot below.\r\n<br />\r\n<br />\r\nNote - If the responsive layout is enabled the drop down will disable when the screen size reaches 750px so that it does not interfere with the mobile menu bar\r\n\r\n<br />\r\n<br />\r\n<img alt=\"\" style=\"border:1px solid #CCCCCC\" class=\"padded\" src=\"http://www.shape5.com/demo/images/general/dropdown_tab.png\" />\r\n<div style=\"clear:both\"></div>\r\n<br />\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Customize almost everything! Shadows, borders, gradient, opacity</li> \r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Contains 6 module positions drop_down_1, drop_down_2, drop_down_3, drop_down_4, drop_down_5 and drop_down_6</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Auto adjust to the height of your content</li> \r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set your own open and close text</li> \r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Auto collapse if no modules are published to it</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>And many more features!</li>\r\n</ul>\r\n<br />\r\n<br />\r\n<h3 class=\"s5_demo_h3\">Screenshot of Drop Down admin in template configuration area:</h3><br />\r\n<img alt=\"\"  src=\"http://www.shape5.com/demo/images/general/dropdown.png\" />\r\n<br><br>\r\n<img alt=\"\"  src=\"http://www.shape5.com/demo/images/general/dropdown2.png\" />\r\n\r\n<div style=\"clear:both; height:0px\"></div>','',1,10,'2013-05-12 03:42:02',809,'','2015-07-14 19:26:26',712,0,'0000-00-00 00:00:00','2013-05-12 03:42:02','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',5,25,'','',1,682,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(21,60,'S5 Flex Menu - Menu System','s5-flex-menu-menu-system','The S5 Flex Menu system is a very powerful plugin that provides functionality \r\nfar beyond what the standard Joomla menu system can provide. This plugin \r\nis intended to be as an extension of the existing menu system in Joomla to add many new features! Please see the full list of features below. \r\n\r\n<br /><br />\r\n\r\nThis menu system works off of the core Joomla jquery/mootools scripts so no extra javascript library is needed and keep download sizes to a minimum. Also, if you do not want to use this menu you can simply turn it it off from the template configuration page.\r\n<br /><br />\r\n\r\nTake your website to  the next design level by using the robust and feature\r\nrich S5 Flex Menu System. Organize your links with ease and show content \r\nin places you never could before!\r\n\r\n<br /><br />\r\n<h3 class=\"s5_demo_h3\">Menu Features:</h3>\r\n\r\n\r\n\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Automatic onclick functionality for tablet sized touch screens. If a device\'s screen is detected as touch screen and is of table size, then the menu will function with an onclick method rather than the onmouseover effect that is shown on a laptop or desktop that has a mouse for use.</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Multiple javascript effects such as fade, slide, etc.</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Multiple columns for menu items or modules.</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Modules load directly into the menu.</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Group sub menu items into the same column or fly out.</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Optional sub texts for each menu item.</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Optional menu icon images for each menu item.</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Automatic multi-language menu change. If you are setting up a multi-language site, the flex menu will automatically change if your site\'s visitor has a language specific menu setup for their language in the menu manager.</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>And much more!</li>\r\n</ul>\r\n\r\n\r\n<br /><br />\r\n<h3 class=\"s5_demo_h3\">Menu Screenshot:</h3>\r\n<br>\r\n<img class=\"padded likeme-disabled\" src=\"images/flexmenu.jpg\" alt=\"\"></img>\r\n\r\n<div style=\"clear:both;height:0px\"></div>\r\n\r\n<br /><br />\r\n\r\n\r\n\r\n<div class=\"blue_box\"><strong>I like what I see! I want to <a href=\"http://www.shape5.com/join-now.html\" target=\"_top\">JOIN TODAY</a>.</strong></div><br /></ul>','',1,10,'2013-05-12 03:42:18',809,'','2016-03-12 23:49:51',384,0,'0000-00-00 00:00:00','2013-05-12 03:42:18','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',9,24,'','',1,1664,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(22,61,'S5 Image and Content Fader','s5-image-and-content-fader','This module can be viewed on this page. The styling of the module shown here is customized specifically for this template with css overrides, and cannot be used with any other template. The same module can be used on any template, but with default or other styling in its place. Publish your own content into each slide transition and for multiple slide transition effects, navigation arrows and also a drop down gallery tab that allows you to select a slide via a thumbnail. You can setup your own custom HTML for each slide or have it automatically pull from articles. This module is fully responsive as well. The S5 Image and Content Fader is powered by Mootools/Jquery. Best of all it&#39;s free!\r\n<br /><br />\r\n\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Features at a glance</h3>\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Pull from custom HTML or articles.</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Responsive layout compatible</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Choose between 4 slide transitions: Fade, Continuous Horiztonal, Fade Slide Left, Continuous Vertical</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Zoom In Option</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Specify height and width of module</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Mobile size options</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Includes a gallery tab drop down to show all images</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Each image slide can have its own hyperlink</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Show up to 10 images at once</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Publish your own content to each picture slide</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Navigation arrows</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Not all slides require titles</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Change delay time</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Hide or show: Navigation arrows, thumbnail carousel and popup text</li>\r\n</ul>\r\n<br /><br />\r\n\r\n\r\n<div class=\"blue_box\">\r\nI like what I see! I want to <a href=\"../../join-now.html\" target=\"_top\"><strong>JOIN TODAY</strong></a>.</div>\r\n<br />','',1,10,'2013-05-12 03:42:38',809,'','2016-02-09 19:15:40',95,0,'0000-00-00 00:00:00','2013-05-12 03:42:38','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',47,23,'','',1,799,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(23,62,'S5 Tab Show','s5-tab-show','The S5 Tab Show can be demo\'d on this page. The styling of the module shown here is customized specifically for this template with css overrides, and cannot be used with any other template. The same module can be used on any template, but with default or other styling in its place.\r\n\r\n<br /><br />\r\n\r\nThe S5 Tab Show will display up to 20 modules in various styles within sliding tabs, and is compatible with responsive sites. Simply publish the S5 Tab Show module to your desired module position and pages. Then start publishing modules to the positions in the Tab Show (s5_tab1, s5_tab2, etc); these modules will become the slides. This is a great way to organize and showcase your site\'s content or images. Version 3 of this module is incredibly powerful, below is a list of all of its features. \r\n\r\n<br /><br />\r\n\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Transitions are powered by CSS3, so no javascript conflicts</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Optional custom classes</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Up to 10 copies of the module on the same pages; each individually controlled</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Use up to 20 slides</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Select on mouseover or on click for activation</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set the loation of the tabs or arrows</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Center the tabs or arrows</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Hide the tabs or arrows until mouseover</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Force the tabs or arrows to be shown for tablets and mobile devices</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Select your transition effect</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set your duration speed</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Add extra padding in between slides or no padding at all</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Optional button text for tabs</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Optional images for tab buttons</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set a background color or image for each slide or the entire module</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Enter pre-text and post-text</li>\r\n</ul>\r\n','',1,10,'2013-05-12 03:43:04',809,'','2015-02-12 16:15:54',42,0,'0000-00-00 00:00:00','2013-05-12 03:43:04','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',41,22,'','',1,709,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}