(30,69,'Search Engine Optimized ','search-engine-optimized','<br/>\r\n<h3 class=\"s5_demo_h3\">SEO - Get your site noticed!</h3>\r\n<p>Not only is this template beautifully designed but it is great for search engine optimization as well! What is SEO? It is simple the act of altering a web site so that it does well in the organic, crawler-based listings of search engines such as google.com. How does this template accomplish this? It&#39;s simple, the majority of your most valuable content is found in the main body of your site, through css we are able to alter the layout of the site and call the main content before the left and right columns are called. This allows for your content to be found first by search engines before it reaches your other content, which is vital in search engine optimization. This is a common feature this can be done with almost all of Shape 5 templates as well.</p>\r\n<p> </p>\r\n<br />\r\n<div class=\"blue_box\"><strong>I like what I see! I want to <a href=\"http://www.shape5.com/join-now.html\" target=\"_top\">JOIN TODAY</a>.</strong></div>','',1,10,'2013-05-12 03:45:28',809,'','2014-10-10 17:12:46',42,0,'0000-00-00 00:00:00','2013-05-12 03:45:28','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,21,'','',1,549,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(31,70,'Site Shapers','site-shapers','<p><br />So what are Site Shapers? They are quick installs of Joomla combined with all the modules, content, etc used on our demo, excluding stock photography. Within a few minutes you can have your site up, running and looking just like our demo. No more importing SQL dumps and installing modules.  Just head on over to the download section of this template and grab a Site Shaper.  Simply install the Site Shaper like any other Joomla installation, it&#39;s that easy!<br /><br /></p>\r\n\r\nNote - This site is intended to imitate a live and published website and does not make any claim of any kind to the validity of non-Shape5 content, articles, images or posts published to this site. \r\n\r\n<br /><br />\r\n\r\n\r\n<div class=\"blue_box\">\r\n<a style=\"text-decoration:underline\" target=\"_blank\" href=\"http://www.shape5.com/documentation/Getting-Started/How-to-Install-a-Joomla-Site-Shaper\">\r\nBe sure to visit our Knowledgebase for in depth video tutorial installation guide.</a>\r\n</div>\r\n\r\n<br /><br />\r\n\r\n<h3 class=\"s5_demo_h3\">How to setup a Site Shaper</h3>\r\n\r\n\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\">01</span>Login to your cpanel or your server admin panel.</li>\r\n<li><span class=\"circle_item\">02</span>Locate the area where your databases are    (usually labeled Mysql Databases)</li>\r\n<li><span class=\"circle_item\">03</span>Create a new database</li>\r\n<li><span class=\"circle_item\">04</span>Next create a new database user and assign    it to this newly created database in the previous step</li>\r\n<li><span class=\"circle_item\">05</span>You will then    need to extract the site shaper to either a folder on your server or the root    directory such as WWW. NOTE: if you already have a website in the root of your    WWW folder, we suggest creating a new folder and extract the site shaper    there. If your cpanel does not have an extract option or you cannot find it,    you may also extract the contents of your site shaper in to a folder on your    desktop and upload all the files via an ftp client to your server.</li>\r\n<li><span class=\"circle_item\">06</span>Next, navigate to the url where you extracted the site shaper via your web browser.</li>\r\n<li><span class=\"circle_item\">07</span>Continue through each screen until you reach the below screenshot:<br /><br />\r\n<img src=\"http://www.shape5.com/demo/images/general/siteshaper.png\" class=\"padded\" /> \r\n</li>\r\n<li><span class=\"circle_item\">08</span>At the above screen be sure to enter localhost as shown, continue to fill in the following text fields with your newly created database and username information</li>\r\n<li><span class=\"circle_item\">09</span>Follow through the rest of the site shaper setup and click the install sample data at the last screen and the installation is complete! (be sure to rename/remove the installation directory after finishing the install)</li>\r\n</ul>\r\n<br />','',1,10,'2013-05-12 03:45:45',809,'','2015-10-10 00:52:10',436,0,'0000-00-00 00:00:00','2013-05-12 03:45:45','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',9,20,'','',1,734,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(32,71,'Stock Photography','stock-photography','All content and images shown on this site is for demo, presentation purposes only. This site is intended to exemplify a live website and does not make any claim of any kind to the validity of non-Shape5 content, images or posts published. Stock photography and icons are often purchased from <a href=\"http://www.shutterstock.com\" target=\"_blank\">shutterstock.com</a> for the demonstration purposes of Shape5.com only, and are not included with this template or any of our downloads. Occasionally open source images are used, some of which are allowed for re-distribution as per their individual licenses, eg: <a href=\"http://www.unsplash.com\" target=\"_blank\">unsplash.com</a>. Images that are not included in our downloads are not licensed for re-distribution and therefore not included, you may not use these items for your own use without first purchasing them from their copyright owner. Links will be provided for some of these items if you wish to purchase them from their copyright owners or download them from their sources. Image(s) or Footage (as applicable from Shutterstock), used under license from Shutterstock.com.','',1,10,'2013-05-12 03:46:04',809,'','2016-02-01 17:24:24',95,0,'0000-00-00 00:00:00','2013-05-12 03:46:04','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',5,18,'','',1,553,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(33,72,'Template Specific Options','template-specific-options','This template is built on the very powerful S5 Vertex Framework, which comes packed with amazing features! <a href=\"http://www.shape5.com/joomla/framework/vertex_framework.html\" target=\"blank\">Learn More About Vertex...</a> <br /><br /> Every template built on Vertex also comes with its own unique template specific options applicable to that particular template such as highlight colors, social icons, and much more. These features are in addition to the standard functions of Vertex, and are still controlled through the very user friendly interface of Vertex. This page will document the features specific to this template. <br /><br />\r\n<h3 class=\"s5_demo_h3\">Theme Specific Configuration Interface of Vertex</h3>\r\nBelow is a screenshot that shows all the template specific features available in the user friendly Vertex admin:<br /><br /> <img class=\"padded\" src=\"images/theme_specific.png\" /> <br /><br /><br />\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Custom Highlight Colors</h3>\r\nStylize your site with any color you want. Set your own custom color scheme with the built in highlight color. This color control menu items, titles, buttons, hover over effects, backgrounds, and more. You can set this color to any color that you want. Below is an example so you can see how this works. In addition to these color options, Vertex itself is loaded with background color and images options under the Main / Layout page in the template configuration. <br /><br /> <img class=\"padded\" src=\"images/highlight_color.jpg\" />\r\n\r\n\r\n\r\n<br /><br /><br />\r\n<h3 class=\"s5_demo_h3\">Custom Highlight Font</h3>\r\nChoose a custom highlight font powered by Google fonts. This font is used mostly on titles, buttons, labels and more. This is used in conjunction with the default site font which is controlled under the Main / Styling tab in the Vertex template configuration, and controls many other elements as well. \r\n<br /><br />\r\n<img class=\"padded\" src=\"images/highlight_font.jpg\"></img>\r\n\r\n\r\n<br /><br /><br />\r\n<h3 class=\"s5_demo_h3\">Uppercase Letters</h3>\r\nChoose to enable or disable uppercase letters on most menu items, buttons, titles and more. <br /><br /> <img class=\"padded\" src=\"images/uppercase1.jpg\" /><br /> \r\n<img class=\"padded\" src=\"images/uppercase2.jpg\" />\r\n\r\n\r\n\r\n<br /><br /><br />\r\n<h3 class=\"s5_demo_h3\">Hide First Menu Item</h3>\r\nWith this option you can hide the first menu item which usually is \"home\".\r\n<br /><br />\r\n<img class=\"padded\" src=\"images/hidehome.jpg\"></img>\r\n\r\n\r\n\r\n<br /><br /><br />\r\n<h3 class=\"s5_demo_h3\">Hide Menu Arrows</h3>\r\nWith this option you can disable the menu item sub menu arrows on first level parent items. <br /><br /> <img class=\"padded\" src=\"images/sub_arrows1.jpg\" />\r\n<br /> \r\n<img class=\"padded\" src=\"images/sub_arrows2.jpg\" />\r\n\r\n\r\n\r\n<br /><br /><br />\r\n<h3 class=\"s5_demo_h3\">Video Overlay Effect</h3>\r\nWith this option you can enable or disable a dark overlay over top of the video that is published to custom_1.\r\n\r\n\r\n\r\n<br /><br /><br />\r\n<h3 class=\"s5_demo_h3\">Header Background and Logo</h3>\r\nWhenever custom_1 is not used a separate image and color set is used for the header area. You may either set this an image background or a solid color. Also, the logo will be automatically in the middle of the menu. See the <a href=\"index.php/tutorials-menu-48/custom-code-for-this-design\">Custom Code</a> page for more instructions. The logo is required for this design or it will cause header issues.<br /><br /> \r\n<img class=\"padded\" src=\"images/header_backgrounds.jpg\" />\r\n\r\n\r\n\r\n<br /><br /><br />\r\n<h3 class=\"s5_demo_h3\">Social Icons</h3>\r\nAlthough not a special feature of the template, the Ion Icons enabled social icons are stylized for the custom_4 position. <br /><br /> \r\n<img class=\"padded\" src=\"images/socialicons.jpg\" />','',1,10,'2013-05-12 03:46:20',809,'','2017-04-12 17:33:38',832,0,'0000-00-00 00:00:00','2013-05-12 03:46:20','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',288,17,'','',1,1640,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(35,74,'The Template\'s Settings','the-template-s-settings','This template comes loaded with options that you can use to customize your site exactly how you want it. Here&#39;s how to get to these custom settings:</p>\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\">01</span>In the backend of Joomla go menu item Extensions/Template Manager.</li>\r\n<li><span class=\"circle_item\">02</span>Click on the title of the template.</li>\r\n<li><span class=\"circle_item\">03</span>This will bring you to the template manager screen where you can edit the template&#39;s parameters.</li>\r\n<li><span class=\"circle_item\">04</span>Click save when you are done</li>\r\n</ul>\r\n<br />\r\n<img class=\"padded\" src=\"http://www.shape5.com/demo/images/general/template_edit15.jpg\" border=\"0\" alt=\" \" /> <br /><br />\r\n<div class=\"blue_box\"><strong>I like what I see! I want to <a href=\"http://www.shape5.com/join-now.html\" target=\"_top\" style=\"color:#1B6FC2; text-decoration:underline\">JOIN TODAY</a>.</strong></div>\r\n','',1,10,'2013-05-12 03:47:23',809,'','2014-08-09 14:46:44',42,0,'0000-00-00 00:00:00','2013-05-12 03:47:23','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',6,15,'','',1,566,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(36,75,'Tool Tips','tool-tips','<div class=\"blue_box\"><strong>Note - The tool tips script is by default disabled. If you wish to use it you must enable this script in the template&#39;s configuration area. This also includes site shaper installations.</strong></div>\r\n<br/>\r\n<div class=\"blue_box\">\r\n<a style=\"text-decoration:underline\" target=\"_blank\" href=\"http://www.shape5.com/documentation/Core-Features/Javascript-Effects\">\r\nFor a tutorial on how to setup this script be sure to view our guide.</a>\r\n</div>\r\n\r\n<br/>\r\n<br/>\r\n<strong>\r\nDemo 1:\r\n</strong>\r\n<br />\r\n\r\n\r\n\r\n\r\n<a onmouseover=\"Tip(&#39;This is a sample tooltip.&#39;, WIDTH, 140, OPACITY, 80, ABOVE, true, OFFSETX, 1, FADEIN, 200, FADEOUT, 300,SHADOW, true, SHADOWCOLOR, &#39;#000000&#39;,SHADOWWIDTH, 2, BGCOLOR, &#39;#000000&#39;,BORDERCOLOR, &#39;#000000&#39;,FONTCOLOR, &#39;#FFFFFF&#39;, PADDING, 9)\" href=\"http://www.shape5.com/demo/etensity/\">\r\n\r\n<img class=\"boxed2\" alt=\"\" src=\"http://www.shape5.com/demo/smart_blogger/images/tooltip.jpg\"/>\r\n\r\n</a>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<br/><br />\r\n<strong>\r\nDemo 2:\r\n</strong>\r\n<br />\r\n\r\n\r\n\r\n<a href=\"index.htm\" onmouseover=\"Tip(&#39;Image Demo<br /> <br /><img src=http://www.shape5.com/demo/smart_blogger/images/tooltip.jpg width=220 height=147>&#39;)\"><strong>Demo 2 Image Tool Tip</strong></a><br/><br/> \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<strong>\r\nDemo 3:\r\n</strong>\r\n<br />\r\n\r\n\r\n\r\n\r\n<a href=\"#\" onmouseover=\"Tip(&#39;Image Demo<br /> <br /><img src=http://www.shape5.com/demo/smart_blogger/images/tooltip.jpg width=220 height=147>&#39;,SHADOW, true,  BGCOLOR, &#39;#000000&#39;, FADEIN, 400, FADEOUT, 400, SHADOWCOLOR, &#39;#000000&#39;, BORDERCOLOR, &#39;#000000&#39;, OPACITY, 90,FONTCOLOR, &#39;#FFFFFF&#39;)\"><strong>Demo 3 Image Tool Tip</strong></a>\r\n<br/><br/>','',1,10,'2013-05-12 03:47:41',809,'','2015-12-11 16:49:13',239,0,'0000-00-00 00:00:00',