(37,76,'Typography Options','typography-options','<br>\r\n\r\n<h3 class=\"s5_demo_h3\">Drop Caps</h3>\r\n\r\n<p>\r\n<span class=\"firstcharacter\">L</span> orem ipsum dolor sit amet, consectetur adipiscing elit. Mauris tristique lobortis orci ac lacinia. Fusce eu purus eget diam vehicula auctor nec eu elit. Morbi consequat facilisis orci vel malesuada. Donec ultrices molestie sollicitudin. Morbi consequat facilisis orci vel malesuada. Donec ultrices molestie sollicitudin. Mauris tristique lobortis orci ac lacinia.  Mauris tristique lobortis orci ac lacinia. \r\n</p>\r\n\r\n<div class=\"code\">\r\nApply a drop cap with a wrapping span class as follows:  &lt;span class=\"firstcharacter\"&gt;L&lt;/span&gt;orem ipsum\r\n</div>\r\n\r\n<br>\r\n\r\n<p>\r\n<span class=\"firstcharacter2\">L</span> orem ipsum dolor sit amet, consectetur adipiscing elit. Mauris tristique lobortis orci ac lacinia. Fusce eu purus eget diam vehicula auctor nec eu elit. Morbi consequat facilisis orci vel malesuada. Donec ultrices molestie sollicitudin. Morbi consequat facilisis orci vel malesuada. Donec ultrices molestie sollicitudin. Mauris tristique lobortis orci ac lacinia.  Mauris tristique lobortis orci ac lacinia. \r\n</p>\r\n\r\n\r\n\r\n<div class=\"code\">\r\nApply a drop cap with a wrapping span class as follows:  &lt;span class=\"firstcharacter2\"&gt;L&lt;/span&gt;orem ipsum\r\n</div>\r\n\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"drop_class\">\r\nPorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris tristique lobortis orci ac lacinia. Fusce eu purus eget diam vehicula auctor nec eu elit. Morbi consequat facilisis orci vel malesuada. Donec ultrices molestie sollicitudin. Morbi consequat facilisis orci vel malesuada. Donec ultrices molestie sollicitudin. Mauris tristique lobortis orci ac lacinia.  Mauris tristique lobortis orci ac lacinia.\r\n</p>\r\n\r\n<div class=\"code\">\r\nApply a drop cap with a class on a wrapping paragraph tag as follows:  &lt;p class=\"drop_class\"&gt;Porem ipsum&lt;/a&gt;\r\n</div>\r\n\r\n<br>\r\n\r\n<p class=\"drop_class2\">\r\nPorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris tristique lobortis orci ac lacinia. Fusce eu purus eget diam vehicula auctor nec eu elit. Morbi consequat facilisis orci vel malesuada. Donec ultrices molestie sollicitudin. Morbi consequat facilisis orci vel malesuada. Donec ultrices molestie sollicitudin. Mauris tristique lobortis orci ac lacinia.  Mauris tristique lobortis orci ac lacinia.\r\n</p>\r\n\r\n\r\n\r\n<div class=\"code\">\r\nApply a drop cap with a class on a wrapping paragraph tag as follows:  &lt;p class=\"drop_class2\"&gt;Porem ipsum&lt;/a&gt;\r\n</div>\r\n\r\n\r\n\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Video Overlay</h3>\r\n\r\n<div style=\"max-height:700px;min-height:300px;background:url(http://www.shape5.com/demo/images/general/video/video_preload.jpg);\" class=\"video_overlay_wrap\">\r\n	<video src=\"http://www.shape5.com/demo/images/general/video/video.mp4\" loop=\"loop\" autoplay=\"autoplay\" muted=\"\"></video>\r\n	<div class=\"video_overlay_text_wrap\">\r\n	<div class=\"video_overlay_text_wrap_inner\">\r\n		Lorem ipsum dolor sit amet, consectetur adipiscing elit. Morbi efficitur scelerisque ligula, sit amet fermentum metus.\r\n		<div style=\"clear:both;height:0px;\"></div>\r\n	</div>\r\n	</div>\r\n</div>\r\n\r\n<br>\r\n\r\n<a target=\"_blank\" href=\"http://www.videvo.net/video/working-on-laptop-1/3517\">The Video Above Is Not Included And May Be Downloaded From: http://www.videvo.net/video/working-on-laptop-1/3517</a>\r\n\r\n<br>\r\n<br>\r\n\r\n\r\n1. Enter the url of your video in the video src area.<br>\r\n2. Enter your background image under the video_overlay_wrap style area. This is the background image that appears before the video loads and at 1024px. Please note that all videos disable at 1024px due to restrictions on tablets and phones.<br>\r\n3. Enter an optional max-height under the video_overlay_wrap style area. This will prevent the video from becoming larger than the height specified.<br>\r\n4. Enter an optional min-height under the video_overlay_wrap style area. This will prevent the video from becoming smaller than the height specified. This is very useful for when the video is disabled at 750px, and the background image shows in its place.<br>\r\n4. Enter an optional width under the video_overlay_wrap style area. This will stretch the video to a specified length, but will be cropped off by the surrounding parent div.<br>\r\n4. Enter your desired text in the video_overlay_text_wrap_inner area. Text should be minimal to avoid any space issues on smaller screens; videos maintain ratio and decrease on smaller devices.\r\n\r\n<br>\r\n\r\n<div class=\"code\">\r\n&lt;div class=\"video_overlay_wrap\" \r\nstyle=\"max-height:700px;min-height:300px;width:1500px;background:url(images/video_preload.jpg);\"&gt;<br>\r\n&lt;video muted autoplay=\"autoplay\" loop=\"loop\" src=\"images/video.mp4\"&gt;&lt;/video&gt;<br>\r\n&lt;div class=\"video_overlay_text_wrap\"&gt;<br>\r\n&lt;div class=\"video_overlay_text_wrap_inner\"&gt;<br>\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Morbi efficitur \r\nscelerisque ligula, sit amet fermentum metus.<br>\r\n&lt;div style=\"clear:both;height:0px;\"&gt;&lt;/div&gt;<br>\r\n&lt;/div&gt;<br>\r\n&lt;/div&gt;<br>\r\n&lt;/div&gt;\r\n</div>\r\n\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Social Icons</h3>\r\n\r\n<a class=\"social_icon ion-social-facebook\" href=\"/demo/ambient/\"></a> \r\n<a class=\"social_icon ion-social-twitter\" href=\"/demo/ambient/\"></a> \r\n<a class=\"social_icon ion-social-googleplus\" href=\"/demo/ambient/\"></a> \r\n<a class=\"social_icon ion-social-rss\" href=\"/demo/ambient/\"></a> \r\n<a class=\"social_icon ion-social-pinterest\" href=\"/demo/ambient/\"></a> \r\n\r\n<br><br>\r\n\r\nIon Icons must be enabled to use these icons.\r\n\r\n<br>\r\n\r\n<div class=\"code\">\r\n&lt;a href=\"\" class=\"social_icon ion-social-facebook\"&gt;&lt;/a&gt; <br>\r\n&lt;a href=\"\" class=\"social_icon ion-social-twitter\"&gt;&lt;/a&gt; <br>\r\n&lt;a href=\"\" class=\"social_icon ion-social-googleplus\"&gt;&lt;/a&gt; <br>\r\n&lt;a href=\"\" class=\"social_icon ion-social-rss\"&gt;&lt;/a&gt; <br>\r\n&lt;a href=\"\" class=\"social_icon ion-social-pinterest\"&gt;&lt;/a&gt; \r\n</div>\r\n\r\n<br><br>\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Notifications</h3>\r\n\r\n<div class=\"black_box\">This is a styled box. Use <strong>&lt;div class=\"black_box\"&gt;Your content goes here!&lt;/div&gt;</strong></div>\r\n<p> </p>\r\n<div class=\"gray_box\">This is a styled box. Use <strong>&lt;div class=\"gray_box\"&gt;Your content goes here!&lt;/div&gt;</strong></div>\r\n<p> </p>\r\n<div class=\"red_box\">This is a styled box. Use <strong>&lt;div class=\"red_box\"&gt;Your content goes here!&lt;/div&gt;</strong></div>\r\n<p> </p>\r\n<div class=\"blue_box\">This is a styled box. Use <strong>&lt;div class=\"blue_box\"&gt;Your content goes here!&lt;/div&gt;</strong></div>\r\n<p> </p>\r\n<div class=\"green_box\">This is a styled box. Use <strong>&lt;div class=\"green_box\"&gt;Your content goes here!&lt;/div&gt;</strong></div>\r\n<p> </p>\r\n<div class=\"yellow_box\">This is a styled box. Use <strong>&lt;div class=\"yellow_box\"&gt;Your content goes here!&lt;/div&gt;</strong></div>\r\n<p> </p>\r\n<div class=\"orange_box\">This is a styled box. Use <strong>&lt;div class=\"orange_box\"&gt;Your content goes here!&lt;/div&gt;</strong></div>\r\n<p>\r\n<br>\r\n\r\n</p><h3 class=\"s5_demo_h3\">Images</h3>\r\n\r\n\r\n This is an image with the \"boxed\" class applied:<br><br>  <img alt=\"\" src=\"http://www.shape5.com/demo/images/small1.jpg\" class=\"boxed\">\r\n\r\n\r\n <br><br> This is an image with the \"boxed_white\" class applied:<br><br> <img alt=\"\" src=\"http://www.shape5.com/demo/images/small1.jpg\" class=\"boxed_white\">\r\n\r\n <br><br> This is an image with the \"boxed_black\" class applied:<br><br> <img alt=\"\" src=\"http://www.shape5.com/demo/images/small1.jpg\" class=\"boxed_black\"> \r\n \r\n <br><br> This is an image with the \"padded\" class applied:<br><br><img alt=\"\" src=\"http://www.shape5.com/demo/images/small1.jpg\" class=\"padded\">\r\n\r\n\r\n <br><br> This is an image with the \"full_width\" class applied. This can also be done automatically in the template configuration. Be sure to review our Vertex Guide <a target=\"_blank\" href=\"http://www.shape5.com/joomla_tutorials.html\">here</a> for other full width image options.<br><br> <img alt=\"\" src=\"http://www.shape5.com/demo/images/general/typography_full_width.jpg\" class=\"full_width\"> <br><br><p></p>\r\n\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Headings</h3>\r\n\r\n\r\n<h1>Heading 1</h1>\r\n<h2>Heading 2</h2>\r\n<h3>Heading 3</h3>\r\n<h4>Heading 4</h4>\r\n<h5>Heading 5</h5>\r\n\r\n\r\n<br><br>\r\n\r\n\r\n\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Ion Icons</h3>\r\n\r\n<div class=\"icon_outer_wrap\">\r\n	<div class=\"icon_hover\">\r\n		<a class=\"ion-link icon_element\" href=\"/demo/ambient/\"></a>\r\n	</div>\r\n	<div class=\"icon_non_hover\">\r\n		<span class=\"ion-headphone icon_element\"></span>\r\n	</div>\r\n</div>\r\n			\r\n<div class=\"code\">\r\n\r\n&lt;div class=\"icon_outer_wrap\"&gt;<br>\r\n&lt;div class=\"icon_hover\"&gt;<br>\r\n&lt;a href=\"\" class=\"ion-link icon_element\"&gt;&lt;/a&gt;<br>\r\n&lt;/div&gt;<br>\r\n&lt;div class=\"icon_non_hover\"&gt;<br>\r\n&lt;span class=\"ion-headphone icon_element\"&gt;&lt;/span&gt;<br>\r\n&lt;/div&gt;<br>\r\n&lt;/div&gt;\r\n\r\n</div>\r\n\r\n<br>\r\n\r\n<a href=\"/demo/ambient/index.php/features-mainmenu-47/continued-vertex-features/ion-icons-integrated\">Click here for more icon examples</a>\r\n\r\n\r\n<br><br>\r\n\r\n<h3 class=\"s5_demo_h3\">Dates</h3>\r\n\r\n<div class=\"date_outer_wrap\">\r\n	<div class=\"date_wrapper\">\r\n		<div class=\"date_top\">\r\n			AUG\r\n		</div>\r\n		<div class=\"date_bottom\">\r\n			22\r\n		</div>\r\n	<