(45,94,'Parallax Backgrounds','parallax-backgrounds','Parallax backgrounds as well as other background options are built directly into the Vertex Framework.  Parallax causes the background image of an element to scroll at a different speed than your browser. For an example of this view the homepage of the Velocity template <a href=\"http://www.shape5.com/demo/velocity/\" target=\"_blank\">here</a> and watch the background of the top_row1 area as you scroll down the page. This feature is found under \"Backgrounds\" tab in Vetex, where you can control the background for many areas of your website. \r\n<br><br>\r\n\r\n<h3 class=\"s5_demo_h3\">Features:</h3>\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set the scroll speed of the images</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set background repeat style</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set background image size, 100%, cover, contain, etc</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set custom backgrounds for all s5 rows in the framework.</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Enable or disable parallax on a per row basis</li>\r\n</ul>\r\n\r\n<br><br>\r\nAdmin Area Of The Backgrounds Tab:<br><br>\r\n<img src=\"http://www.shape5.com/demo/images/general/parallax_admin.jpg\" alt=\"parallax menu admin\"/>\r\n<br><br>\r\n<img src=\"http://www.shape5.com/demo/images/general/parallax_admin2.jpg\" alt=\"parallax menu admin\"/>','',1,10,'2013-12-12 19:21:58',809,'','2015-07-14 19:24:00',712,0,'0000-00-00 00:00:00','2013-12-12 19:21:58','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\"