(46,95,'Floating Menu','floating-menu','The floating menu feature is a great way for your users to easily navigate your website! The floating menu will show at the top of your browser once the screen reaches a certain point. You can determine the exact point at which this occurs via the template specific area of Vertex. NOTE: This is a Vertex addition and is not guaranteed to work with all Vertex Templates.  Some custom CSS may need to be adjusted per template. This feature is not supported by IE7/8.\r\n<br><br>\r\n<h3 class=\"s5_demo_h3\">Features at a glance:</h3>\r\n\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set a background image to the menu, gradient or solid color</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set to snap or smooth scroll in</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Determine at which point as you scroll down your page that the menu drops in</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>and many more features, just check out the screenshot below</li>\r\n</ul>\r\n<br>\r\n<br>\r\n<h3 class=\"s5_demo_h3\">Admin area of the floating menu:</h3>\r\n<img alt=\"parallax menu admin\" src=\"http://www.shape5.com/demo/images/general/floatingmenu_admin.jpg\">','',1,10,'2013-12-12 19:22:26',809,'','2014-08-09 14:34:22',42,0,'0000-00-00 00:00:00','2013-12-12 19:22:26','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"s