(58,113,'404 Error','404-error','This design comes with a matching 404 page for users who reach an unrecognized site url. Below is a screenshot of that link or you can see it <a href=\"index.php/wrong_link\">live here</a>.\r\n<br />\r\n<br />\r\nShape5 Vertex uses articles to display a 404 page rather than a hard coded php file that\'s hard to modify, like many other designs do. This means you can modify the look or wording of the page very easy without having to modify a file, and it keeps all of your site navigation in tact for ease of use for your site viewers since it uses the template and not an external file. It\'s as simple as editing an article through the CMS to make any desired changes, or simply leave it as shown! Our site shapers come pre-packaged with the custom 404 page article. If you are setting up a brand new site without a site shaper the easy follow instructions are below the screenshot on this page.\r\n<br />\r\n<br />\r\n<img src=\"images/404.jpg\" alt=\"\" />\r\n<br />\r\n<br />\r\n<br />\r\n<h3 class=\"s5_demo_h3\">Setup Instructions</h3>\r\n<ul>\r\n<li>These instructions are for non site shaper installs. If you\'re installing with a shaper just make sure to leave the article titled \"404 Error Page\" published and you\'re done!</li>\r\n<li>If you are installing a fresh installation with no sample data simply create an article and make sure it\'s titled \"404 Error Page\". It must be given this name for the Vertex framework to identify the page needed to be used.</li>\r\n<li>You can put any content that you want on this new article, or we\'ve provided the code used on this demo below.</li>\r\n<li>Save the article to any category, just make sure it\'s published.</li>\r\n<li>That\'s it, you\'re done! The site will now redirect to this article when ever an unrecognized url is detected.</li>\r\n</ul>\r\n<br />\r\n<br />\r\n<h3 class=\"s5_demo_h3\">The Code Used For This Demo</h3>\r\n<div class=\"code\">\r\n&lt;div id=&quot;wrap_404&quot;&gt;<br>\r\n&lt;h3 class=&quot;title_404&quot;&gt;404&lt;/h3&gt;<br>\r\n&lt;span class=&quot;line_1_404&quot;&gt;Oops, sorry we can\'t find that page!&lt;/span&gt;<br>\r\n&lt;br /&gt;<br>\r\n&lt;span class=&quot;line_2_404&quot;&gt;Either something went wrong or the page doesn\'t exist \r\nanymore.&lt;/span&gt;<br>\r\n&lt;br /&gt;<br>\r\n&lt;a href=&quot;&quot; class=&quot;readon&quot;&gt;Home Page&lt;/a&gt;<br>\r\n&lt;/div&gt;\r\n</div>','',1,24,'2014-06-09 15:12:20',809,'','2015-08-13 18:36:39',643,0,'0000-00-00 00:00:00','2014-06-09 15:12:20','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',18,2,'','',1,681,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
