(68,125,'S5 Live Search','s5-live-search','The S5 Live Search module is demo\'d on this page and can be used on any Joomla template. The styling of the module shown here is customized specifically for this template with css overrides, and cannot be used with any other template. The same module can be used on any template, but with default or other styling in its place. <br><br>  Allow your users to search quickly and without loading or refreshing pages with our amazing ajax search module! Simply publish the module to the \'search\'  position.<br><br><p align=\"center\">  <img src=\"images/live_search.jpg\" class=\"boxed\"></p>\r\n\r\n\r\n <br><br>  \r\n\r\n\r\n <div class=\"blue_box\"><strong>I like what I see! I want to <a target=\"_top\" href=\"http://www.shape5.com/join-now.html\">JOIN TODAY</a>.</strong></div>','',1,10,'2014-07-08 21:16:32',809,'','2015-12-11 16:13:54',239,0,'0000-00-00 00:00:00','2014-07-08 21:16:32','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',8,16,'','',1,599,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(71,128,'Scroll Reveal','scroll-reveal','Our Scroll Reveal feature is powered by the script found here: https://github.com/julianlloyd/scrollReveal.js.  The script allows you to add \"data-sr\" to HTML elements for on page scroll animations. We recommend adding to DIVs over SPAN etc as DIVs can move vs SPAN tags just fading in.  Once you add the code to a DIV refresh a page or scroll down and it will animate in.  It will only do this once until you refresh the page again.  The great feature about the script is you can use plain English to describe how you\'d like to animate your HTML element.\r\n<br><br>\r\n\r\n<h3 class=\"s5_demo_h3\">Example of this in action (refresh this page if you didn\'t see it already):</h3>\r\n\r\n<div data-sr=\"enter left, over 1.33s, move 100px\">enter left, over 1.33s, move 100px</div>\r\n<div data-sr=\"enter bottom, wait 1s, move 100px\">enter bottom, wait 1s, move 100px</div>\r\n<div data-sr=\"enter left move 500px, over 1.33s, wait 2.5s\">enter left move 500px, over 1.33s, wait 2.5s</div>\r\n\r\n<br><br>\r\n<h3 class=\"s5_demo_h3\">Code used for the above:</h3>\r\n<div class=\"code\">\r\n&lt;div data-sr=&quot;enter left, over 1.33s, move 100px&quot;&gt;enter left, over 1.33s, \r\nmove 100px&lt;/div&gt;<br>\r\n&lt;div data-sr=&quot;enter bottom, wait 1s, move 100px&quot;&gt;enter bottom, wait 1s, move \r\n100px&lt;/div&gt;<br>\r\n&lt;div data-sr=&quot;enter left move 500px, over 1.33s, wait 2.5s&quot;&gt;enter left move \r\n500px, over 1.33s, wait 2.5s&lt;/div&gt;\r\n</div>\r\n\r\n<br>\r\n<h3 class=\"s5_demo_h3\">Usage:</h3>\r\n\r\nFor a lengthier explanation on this visit the following page: <a href=\"https://github.com/julianlloyd/scrollReveal.js\" target=\"_blank\">https://github.com/julianlloyd/scrollReveal.js</a>','',1,10,'2014-07-13 01:57:13',809,'','2016-06-28 13:46:09',695,0,'0000-00-00 00:00:00','2014-07-13 01:57:13','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_captio