(75,132,'Ion Icons Integrated','ion-icons-integrated','Ion Icons is an iconic font that gives you scalable vector icons that can be customized by any font css command, such as size, color, backgrounds, hover effects and more. Below you will see several examples of this feature in action, but please visit <a href=\"http://ionicons.com/\" target=\"_blank\">http://ionicons.com/</a> for a full list of all icons available.\r\n\r\n<br /><br />\r\n\r\n<h3 class=\"s5_demo_h3\">Round icon example:</h3>\r\n\r\n<div class=\"icon_outer_wrap\">\r\n	<div class=\"icon_hover\">\r\n		<a href=\"\" class=\"ion-link icon_element\"></a>\r\n	</div>\r\n	<div class=\"icon_non_hover\">\r\n		<span class=\"ion-headphone icon_element\"></span>\r\n	</div>\r\n</div>\r\n			\r\n<div class=\"code\">\r\n\r\n&lt;div class=&quot;icon_outer_wrap&quot;&gt;<br>\r\n&lt;div class=&quot;icon_hover&quot;&gt;<br>\r\n&lt;a href=&quot;&quot; class=&quot;ion-link icon_element&quot;&gt;&lt;/a&gt;<br>\r\n&lt;/div&gt;<br>\r\n&lt;div class=&quot;icon_non_hover&quot;&gt;<br>\r\n&lt;span class=&quot;ion-headphone icon_element&quot;&gt;&lt;/span&gt;<br>\r\n&lt;/div&gt;<br>\r\n&lt;/div&gt;\r\n\r\n</div>\r\n\r\n<br /><br />\r\n\r\n<h3 class=\"s5_demo_h3\">Icon Examples:</h3>\r\n\r\n\r\n<div class=\"code\">\r\n\r\n&lt;span class=&quot;ion-camera&quot; style=&quot;display: \r\ninline-block;font-size:2.5em;&quot;&gt;&lt;/span&gt;\r\n\r\n</div>\r\n\r\n\r\n<br /><br /><span class=\"ion-camera\" data-tags=\"photo\" data-pack=\"default\" style=\"display: inline-block;margin-right:25px;margin-bottom:25px;font-size:2.5em;\"></span>\r\n<span class=\"ion-eye\" data-tags=\"view, see, creeper\" data-pack=\"default\" style=\"display: inline-block;margin-right:25px;margin-bottom:25px;font-size:2.5em;\"></span>\r\n<span class=\"ion-eye-disabled\" data-tags=\"view, see, creeper\" data-pack=\"default\" style=\"display: inline-block;margin-right:25px;margin-bottom:25px;font-size:2.5em;\"></span>\r\n<span class=\"ion-flash\" data-tags=\"lig