(84,143,'S5 Masonry Module','s5-masonry-module','The Masonry module is demo\'d on this page, and is a powerful module that pulls your article from a category or categories and can display them in masonry style format.  The module automatically changes on screen resize to fit the screen a user is viewing them on.  You can choose to output a \"load more\" button that will load a set number of articles you define via AJAX.  The second method to load articles is \"scroll to load\" which will load articles once you scroll to the bottom of your screen.  You simply assign an intro image under your \"Image and Links\" parameters area of your article and then if you choose to show it in the module it will show up. The intro text will show up if you\'ve added text to your article before your read more button.\r\n<br/><br/>\r\n<h3 class=\"s5_demo_h3\">Features:</h3>\r\n\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Choose to enable scroll to load or load more or neither</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Show or hide category elector</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Show or hide read more</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set how many articles are to be shown</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set how many articles are to load via AJAX button or scroll methods</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Order articles by publish date, created date, random or ordering</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Show or hide hits</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Standard layout or hover layout</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Responsive ready and more, view the below admin screenshot to see all the features</li>\r\n\r\n</ul>\r\n\r\n<br/><br/>\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Admin Area Features:</h3>\r\n<img src=\"http://www.shape5.com/demo/images/general/masnoryadmin.jpg\" alt=\"admin\"/>','',0,10,'2014-09-14 02:05:39',809,'','2016-11-28 19:25:05',564,0,'0000-00-00 00:00:00','2014-09-14 02:05:39','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',13,12,'','',1,81,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(108,189,'Custom Code Used For This Design','code-used-for-this-design','Occasionally we need to use custom HTML to obtain the layouts shown on our demos in specific modules. The code below is what was used on this template. It is best to enter this code directly into the HTML editor function of your editor. Some area may require that you enable the Ion Icons (Under General) and Scroll Reveal (Under Javascripts) features in the template configuration. <br /> <br />\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Logo Setup:</h3>\r\n\r\nThe logo setup for this design is a little different than most of our templates. You can still pick your logo type from under Main/Logo in the template configuration, but you most also create a menu item on your main menu. Name the menu item \"Logo Position\", the type should be a Text Separator, and under Link Type set the CSS Style to \"s5_logo_spacer\". By creating a menu item with those specific settings the logo will automatically appear in that menu item\'s position. A logo is required for this design or it will cause header layout issues.<br /><br /> \r\n\r\n<img class=\"padded\" src=\"images/custom9.jpg\" alt=\"\" /> \r\n<br /> \r\n<img class=\"padded\" src=\"images/logo_setting.jpg\" alt=\"\" /> \r\n\r\n\r\n<br /> <br />\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Video and Text:</h3>\r\n\r\nThis area consists of the custom_1 and custom_2 position. The video is a custom html module published to custom_1, and the text is a custom html module published to custom_2. There is a setting in the Theme Specific tab of the configuration to enable or disable an overlay on the video. Alternatively you can also publish the S5 Image and Content Fader module to custom_1.<br /><br /> \r\n\r\n<img class=\"padded\" src=\"images/custom1.jpg\" alt=\"\" /> <br /> <br />\r\n\r\nVideo: <br />\r\n<div class=\"code\">\r\n&lt;div class=&quot;video_wrap&quot; style=&quot;max-height:1010px;min-height:700px;background: \r\nurl(\'images/video_preload.jpg\');&quot;&gt;<br>\r\n&lt;video muted autoplay=&quot;autoplay&quot; loop=&quot;loop&quot; src=&quot;images/video.mp4&quot;&gt;&lt;/video&gt;<br>\r\n&lt;div class=&quot;video_overlay&quot;&gt;&lt;/div&gt;<br>\r\n&lt;/div&gt;\r\n</div>\r\n<br />\r\n\r\nVideo Text: <br />\r\n<div class=\"code\">\r\n&lt;div class=&quot;video_text&quot;&gt;<br>\r\n&lt;img class=&quot;video_text_img&quot; src=&quot;images/mountain.png&quot; alt=&quot;&quot; /&gt;<br>\r\n&lt;div class=&quot;video_text_sub&quot;&gt;Biking and Hiking Club&lt;/div&gt;<br>\r\n&lt;div class=&quot;video_text_large&quot;&gt;Ready For Adventure&lt;/div&gt;<br>\r\n&lt;a href=&quot;index.php/features-mainmenu-47/template-specific-features&quot; class=&quot;readon&quot;&gt;Achieve \r\nMore Together&lt;/a&gt;<br>\r\n&lt;div style=&quot;clear:both;height:0px;&quot;&gt;&lt;/div&gt;<br>\r\n&lt;/div&gt;\r\n</div>\r\n\r\n<br /><br />\r\n\r\n\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Trails In Your Backyard:</h3>\r\n\r\nThis is a custom html module that is published to the top_row1_1 position. The background image is controlled under the Main/Layout tab in the template configuration. Scroll reveal must be enabled for the transition effect.<br /><br /> \r\n\r\n<img class=\"padded\" src=\"images/custom2.jpg\" alt=\"\" /> <br /> <br />\r\n\r\nTrails In Your Backyard: <br />\r\n<div class=\"code\">\r\n&lt;div class=&quot;large_picture&quot;&gt;<br>\r\n&lt;img data-sr=&quot;move 16px scale up 20%, over 0.7s&quot; class=&quot;large_picture_img&quot; src=&quot;images/large_picture.jpg&quot; \r\nalt=&quot;&quot; /&gt;<br>\r\n&lt;div class=&quot;large_picture_text&quot;&gt;<br>\r\n&lt;h3&gt;Trails In Your Backyard&lt;/h3&gt;<br>\r\n&lt;div class=&quot;large_text_sub&quot;&gt;<br>\r\n&lt;div class=&quot;lage_text_sub_line&quot;&gt;&lt;/div&gt;<br>\r\nExplore your local national parks<br>\r\n&lt;/div&gt;<br>\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Proin vestibulum felis \r\nin lacus dignissim venenatis. Morbi quam ante, convallis id venenatis ac, \r\nvulputate ac ex. In in commodo magna. Pellentesque dapibus risus ipsum, sed \r\nullamcorper libero dapibus ac. Morbi porttitor venenatis malesuada. Vivamus eu \r\nmagna bibendum, vestibulum turpis vitae, vestibulum dui. <br>\r\n&lt;/div&gt;<br>\r\n&lt;div style=&quot;clear:both;height:0px;&quot;&gt;&lt;/div&gt;<br>\r\n&lt;/div&gt;\r\n</div>\r\n\r\n<br /><br />\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Accordion Menu and Icons:</h3>\r\n\r\nThis area consists of the S5 Accordion menu published to the top_row2_1 position and a custom html module published to the top_row2_2 position. Scroll reveal must be enabled for the transition effect, and Ion Icons must be enabled for the icons to appear. The available Ion Icons can be found: <a href=\"http://ionicons.com/\" target=\"_blank\">http://ionicons.com/</a><br /><br /> \r\n\r\n<img class=\"padded\" src=\"images/custom3.jpg\" alt=\"\" /> <br /> <br />\r\n\r\nIcons: <br />\r\n<div class=\"code\">\r\n&lt;div class=&quot;icon_group&quot;&gt;<br>\r\n<br>\r\n&lt;div class=&quot;icon_group_item&quot; data-sr=&quot;move 16px scale up 20%, over 0.6s&quot;&gt;<br>\r\n&lt;div class=&quot;icon_group_icon&quot;&gt;<br>\r\n&lt;i class=&quot;ion-flame&quot;&gt;&lt;/i&gt;<br>\r\n&lt;/div&gt;<br>\r\n&lt;div style=&quot;overflow:hidden&quot;&gt;<br>\r\n&lt;span class=&quot;icon_group_title&quot;&gt;Find a Campsite in Your Area&lt;/span&gt;<br>\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Proin vestibulum felis.<br>\r\n&lt;/div&gt;<br>\r\n&lt;/div&gt;<br>\r\n<br>\r\n&lt;div class=&quot;icon_group_item&quot; data-sr=&quot;move 16px scale up 20%, over 0.6s, wait \r\n0.2s&quot;&gt;<br>\r\n&lt;div class=&quot;icon_group_icon&quot;&gt;<br>\r\n&lt;i class=&quot;ion-waterdrop&quot;&gt;&lt;/i&gt;<br>\r\n&lt;/div&gt;<br>\r\n&lt;div style=&quot;overflow:hidden&quot;&gt;<br>\r\n&lt;span class=&quot;icon_group_title&quot;&gt;Learn Survival Techniques&lt;/span&gt;<br>\r\nNullam ac dolor a tortor fermentum interdum et tempus justo a sollicitudin mi.<br>\r\n&lt;/div&gt;<br>\r\n&lt;/div&gt;<br>\r\n<br>\r\n&lt;div class=&quot;icon_group_item&quot; data-sr=&quot;move 16px scale up 20%, over 0.6s, wait \r\n0.4s&quot;&gt;<br>\r\n&lt;div class=&quot;icon_group_icon&quot;&gt;<br>\r\n&lt;i class=&quot;ion-leaf&quot;&gt;&lt;/i&gt;<br>\r\n&lt;/div&gt;<br>\r\n&lt;div style=&quot;overflow:hidden&quot;&gt;<br>\r\n&lt;span class=&quot;icon_group_title&quot;&gt;Hike New Trails Nearby&lt;/span&gt;<br>\r\nPraesent arcu justo, vestibulum non ante sit amet, tincidunt placerat odio.<br>\r\n&lt;/div&gt;<br>\r\n&lt;/div&gt;<br>\r\n<br>\r\n&lt;div class=&quot;icon_group_item&quot; data-sr=&quot;move 16px scale up 20%, over 0.6s, wait \r\n0.6s&quot;&gt;<br>\r\n&lt;div class=&quot;icon_group_icon&quot;&gt;<br>\r\n&lt;i class=&quot;ion-information-circled&quot;&gt;&lt;/i&gt;<br>\r\n&lt;/div&gt;<br>\r\n&lt;div style=&quot;overflow:hidden&quot;&gt;<br>\r\n&lt;span class=&quot;icon_group_title&quot;&gt;Find Out More Information&lt;/span&gt;<br>\r\nProin vestibulum felis. Lorem ipsum dolor sit amet, consectetur adipiscing elit.<br>\r\n&lt;/div&gt;<br>\r\n&lt;/div&gt;<br>\r\n<br>\r\n&lt;div style=&quot;clear:both;height:0px;&quot;&gt;&lt;/div&gt;<br>\r\n<br>\r\n&lt;/div&gt;\r\n</div>\r\n\r\n<br /><br />\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Trails In Your Backyard:</h3>\r\n\r\nThis area consists of three custom html modules, one is published to top_row3_1, and two are published to custom_5. The background image is controlled under the Main/Layout tab in the template configuration. Scroll reveal must be enabled for the transition effect. Info slide must be enabled for the hover effect on the instructor images. The \"Instructor / FPEA Certified\" module uses the class suffix \"white\".<br /><br /> \r\n\r\n<img class=\"padded\" src=\"images/custom4.jpg\" alt=\"\" /> <br /> <br />\r\n\r\nInstructors / FPEA Certified: <br />\r\n<div class=\"code\">\r\n&lt;div