(109,230,'Full Page Scroll','full-page-scroll','The full page scroll option takes each row of Vertex and sets it to the height of your screen.  With the arrow buttons of your keyboard or the vertical scrolling of your mouse the screen will jump to the next section.  Each row that has modules published to it will show as the full height of your screen.  To demo this check out the homepage of this demo.  You can enable on the homepage only or have it show on all pages.  We recommend that it shows only on the homepage.\r\n<br/><br/>\r\nYou can place the below code on any DIV directly as a child to &lt;div id=\"s5_body_padding\"&gt; and it will make it show up full screen.\r\n<br/><br/>\r\n<div class=\"code\">\r\nclass=\"s5_slidesection\"\r\n</div>\r\n<br/><br/>\r\nThe below screenshot shows the admin area under the \"layout\" area of Vertex.  You simply start adding names for the row names and then it will be enabled.  Be sure to separate them by commas.  You can enable the full page scroll to just show on the homepage only.\r\n<br/><br/>\r\n<img src=\"http://www.shape5.com/demo/images/general/fullpagescroll.jpg\" alt=\"\"/>\r\n<br/><br/>\r\n<br/><br/>\r\nFullscreen scroll navigation that shows on the right hand side of yoursite:\r\n\r\n<br/><br/>\r\n<img src=\"http://www.shape5.com/demo/images/general/fullscreenscroll.jpg\" alt=\"\"/>\r\n\r\n','',1,10,'2015-03-15 20:57:52',809,'','2015-12-04 21:40:18',239,0,'0000-00-00 00:00:00','2015-03-15 20:57:52','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_ca