(184,611,'S5 Disqus Comments','s5-disqus-comments','<div itemprop=\"articleBody\">\r\nThis plugin adds Disqus comments and links to any Joomla article or blog view, it can be demo\'d at the bottom of this page. Disqus is a powerful and free comment system that will integrate into any website. \r\n<br><br>\r\n\r\n\r\n\r\n\r\n<h3 class=\"s5_demo_h3\">Features at a glance</h3>\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Specify your Disqus shortname</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Select a language</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Specify which categories will use the plugin</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Specify individual pages to use the plugin</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Enable or disable the comments link on the category listing</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Enable or disable the comments link on the full article</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Enable or disable the comments link on the featured articles</li>\r\n</ul>\r\n<br>\r\n\r\n\r\n<div class=\"blue_box\">\r\nI like what I see! I want to <a target=\"_top\" href=\"/blog_box/../../join-now.html\"><strong>JOIN TODAY</strong></a>.</div>\r\n<br> 	</div>','',1,10,'2015-12-08 20:13:40',809,'','2015-12-11 16:46:25',239,0,'0000-00-00 00:00:00','2015-12-08 20:13:40','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_in