(198,968,'S5 MailChimp','s5-mailchimp','The Mail Chimp Signup module is demo\'d on this homepage. The module is AJAX powered and allows your users to instantly signup and get added to your MailChimp list that you specify in the module admin. All you need to do is enter your MailChimp API Key and Unique List ID. The styling of the module shown here is customized specifically for this template with css overrides, and cannot be used with any other template. The same module can be used on any template, but with default or other styling in its place. ','',1,8,'2015-01-09 22:28:27',809,'','2017-01-09 22:42:18',911,0,'0000-00-00 00:00:00','2015-01-09 22:28:27','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',3,6,'','',1,482,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','',''),
(199,969,'S5 Quick Contact','s5-quick-contact','The S5 Quick Contact module is demo\'d on this page. This module is a simple way for your visitors to get in contact with you. Sometimes full contact pages are just too much. If you\'re looking for an easy way to stay in contact with your visitors this module is for you. This module has fully configurable language settings, sends emails to a specified admin account, captcha spam protection and much more! And of course it\'s free!\r\n<br>\r\n<br>\r\n<ul class=\"ul_circle_content\">\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Specify text of error message and field names</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Validates email address</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Include intro text if desired</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Set one admin email to receive all emails</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Uses the built-in Joomla email functions</li>\r\n<li><span class=\"circle_item\"><i class=\"ion-star\"></i></span>Optional captcha spam protection</li>\r\n</ul> 	','',0,8,'2015-01-09 22:35:08',809,'','2017-01-09 22:43:50',911,0,'0000-00-00 00:00:00','2015-01-09 22:35:08','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date