(1,'','*','*','','*','Hello [BILLING_FIRSTNAME] [BILLING_LASTNAME], your order has been placed with [SITENAME]','<img src=\"images/invoice_logo.png\" alt=\"invoice logo\" /><br />\r\n<table border=\"0\" style=\"width: 100%;\" cellpadding=\"2\" cellspacing=\"0\">\r\n<tbody>\r\n<tr valign=\"top\">\r\n<td colspan=\"2\" rowspan=\"1\">\r\n<p>Note: Please do not respond directly to this email. This email has been sent from an unmonitored box. To contact [SITENAME] directly, you may use the form found on our CONTACT page. Thank you.</p>\r\n<p>Hello, [BILLING_FIRSTNAME] [BILLING_LASTNAME], we thank you for placing an order with [SITENAME]. Your Order ID is:<strong>[ORDERID]</strong>. The details of your service are as follows:</p>\r\n</td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td>\r\n<h3>Order Information</h3>\r\n<p><strong>Order ID: </strong>[ORDERID]</p>\r\n<p><strong>Invoice Number: </strong>[INVOICENO]</p>\r\n<p><strong>Date: </strong>[ORDERDATE]</p>\r\n<p><strong>Order Amount: </strong>[ORDERAMOUNT]</p>\r\n<p><strong>Order Status: </strong>[ORDERSTATUS]</p>\r\n<p>[CUSTOM_BILLING_FIELD:DAYOFTRASHPICKUP]</p>\r\n<p>[CUSTOM_BILLING_FIELD:APPROXIMATETIMEOFPICKUP]</p>\r\n<p>[CUSTOM_BILLING_FIELD:NAMEOFTRASHCOMPANY]</p>\r\n<p>[CUSTOM_BILLING_FIELD:GATECODE]</p>\r\n<p>[CUSTOMER_NOTE]&nbsp;</p>\r\n<p>[CUSTOM_BILLING_FIELD:HOW]</p>\r\n</td>\r\n<td>\r\n<h3>Billing Information</h3>\r\n<p>[BILLING_FIRSTNAME] [BILLING_LASTNAME]</p>\r\n<p>[BILLING_ADDRESS_1] [BILLING_ADDRESS_2]</p>\r\n<p>[BILLING_CITY], [BILLING_STATE] [BILLING_ZIP]</p>\r\n<p>[BILLING_PHONE] [BILLING_MOBILE]</p>\r\n<p>[BILLING_EMAIL]</p>\r\n<p>[BILLING_COMPANY]</p>\r\n<h3>Service Address</h3>\r\n<p>[SHIPPING_FIRSTNAME] [SHIPPING_LASTNAME]</p>\r\n<p>[SHIPPING_ADDRESS_1] [SHIPPING_ADDRESS_2]</p>\r\n<p>[SHIPPING_CITY], [SHIPPING_STATE] [SHIPPING_ZIP]</p>\r\n<p>[SHIPPING_MOBILE]</p>\r\n</td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td colspan=\"2\" rowspan=\"1\">\r\n<p>[ITEMS]</p>\r\n</td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td colspan=\"2\">\r\n<p>Please contact us with any questions. You can also view your service details by visiting [INVOICE_URL]</p>\r\n<p>You can use your email address and the following token to view this order [ORDER_TOKEN]</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span style=\"position: absolute; left: -65535px;\"></span><span style=\"position: absolute; left: -65535px;\"></span>','html','','*',1,1),
