(1134,973,'Video Text','','<div class=\"video_text\"><img src=\"/images/mountain.png\" alt=\"\" class=\"video_text_img\" />\r\n<div class=\"video_text_sub\">Smell the Difference!</div>\r\n<div class=\"video_text_large\">Never Touch a Dirty Trash Bin Again</div>\r\n<a href=\"/services-pricing/residential-services-pricing\" class=\"readon\">Sign-Up for Residential</a><a href=\"/services-pricing/commercial-services-pricing\" class=\"readon\">Sign-Up for Commercial</a>\r\n<div style=\"clear: both; height: 0px;\"></div>\r\n<a href=\"/services-pricing/residential-services-pricing\" class=\"readon\">Check Service Area</a><a href=\"/services-pricing/commercial-services-pricing\" class=\"readon\">Link to contact page</a>\r\n<div style=\"clear: both; height: 0px;\"></div>\r\n</div>',1,'custom_2',812,'2021-11-11 02:54:27','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,1,'{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}',0,'*'),
(1135,974,'Tired of dirty, smelly, pest ridden trash cans?','','<div class=\"large_picture\"><img src=\"images/large_picture3.jpg\" alt=\"\" class=\"large_picture_img\" data-sr=\"move 16px scale up 20%, over 0.7s\" />\r\n<div class=\"large_picture_text\">\r\n<h3>Tired of dirty, smelly, pest-ridden trash cans?</h3>\r\n<div class=\"large_text_sub\">\r\n<div class=\"lage_text_sub_line\"></div>\r\nWe know how to fix the problem</div>\r\nIt only takes a single bag of trash containing common household items like tissues, napkins, diapers, eggs, raw meat, spoiled milk, and rotting produce to infect your trash bins with harmful bacteria and germs such as Salmonella, E coli, Listeria, and more. And it only takes a few hours for the bacteria to multiply by the thousands. And it only takes one single touch to potentially become infected.<br /><strong>Beauty Bins  Locally owned and operated by Nelson Cabrera</strong><br /><a href=\"/services-pricing/residential-services-pricing\" class=\"readon\">Residential &nbsp;Get Started</a> <br /> <a href=\"/services-pricing/commercial-services-pricing\" class=\"readon\">Commercial  Get Started</a></div>\r\n<div style=\"clear: both; height: 0px;\"></div>\r\n</div>',1,'top_row1_1',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,0,'{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}',0,'*'),
(1136,975,'Top Icons','','<div class=\"icon_group\">\r\n<div class=\"icon_group_item\" data-sr=\"move 16px scale up 20%, over 0.6s\">\r\n<div class=\"icon_group_icon\"><i class=\"ion-earth\"></i></div>\r\n<div style=\"overflow: hidden;\"><span class=\"icon_group_title\">Visit</span> Our one-of-a-kind sanitizing truck arrives the same day as your local trash company.</div>\r\n</div>\r\n<div class=\"icon_group_item\" data-sr=\"move 16px scale up 20%, over 0.6s, wait 0.2s\">\r\n<div class=\"icon_group_icon\"><i class=\"ion-waterdrop\"></i></div>\r\n<div style=\"overflow: hidden;\"><span class=\"icon_group_title\">Clean</span> Using pressurized water heated to over 200 degrees, we sanitize your bin or dumpster killing 99% of all germs and bacteria.</div>\r\n</div>\r\n<div class=\"icon_group_item\" data-sr=\"move 16px scale up 20%, over 0.6s, wait 0.4s\">\r\n<div class=\"icon_group_icon\"><i class=\"ion-trash-b\"></i></div>\r\n<div style=\"overflow: hidden;\"><span class=\"icon_group_title\">Disinfect</span> We take all the germs and dirty water with us in our self-contained cleaning unit. The result is a cleaned, disinfected, and deodorized bin or dumpster.</div>\r\n</div>\r\n<div class=\"icon_group_item\" data-sr=\"move 16px scale up 20%, over 0.6s, wait 0.6s\">\r\n<div class=\"icon_group_icon\"><i class=\"ion-leaf\"></i></div>\r\n<div style=\"overflow: hidden;\"><span class=\"icon_group_title\">Deodorize</span> We then spray an odor neutralizer leaving behind an fragrant aroma.</div>\r\n</div>\r\n<div style=\"clear: both; height: 0px;\"></div>\r\n</div>',1,'top_row2_2',0,'0000-00-00 00:00:00','2020-02-11 18:22:19','0000-00-00 00:00:00',1,'mod_custom',1,0,'{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}',0,'*'),
