(1138,977,'It\'s a nasty job','','<div class=\"alert_box\">\r\n<div class=\"alert_box_inner\">It\'s a nasty job, but somebody\'s got to do it. Call\r\n<div class=\"alert_phone\"><a href=\"Tel:13059077033\" style=\"color: #ffffff;\">305.907.7033</a></div>\r\n</div>\r\n</div>',1,'custom_5',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,1,'{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}',0,'*'),
(1139,978,'FAQs','','<div class=\"title_left\" data-sr=\"move 16px scale up 20%, over 0.7s\">\r\n<div class=\"title_left_text\">\r\n<div class=\"title_left_text_sub\">Frequently Asked Questions</div>\r\n<h3>Beauty Bins</h3>\r\n</div>\r\n<div style=\"clear: both; height: 0px;\"></div>\r\n</div>\r\n<div class=\"title_left\" data-sr=\"move 16px scale up 20%, over 0.7s\">\r\n<h3 class=\"highlight1_title\">1</h3>\r\n<div class=\"title_left_text\">\r\n<div class=\"title_left_text_sub\">Q. Do I need to be home for your services?</div>\r\nA. No. You do not need to be at home to have your cans cleaned. We clean your cans on your trash pickup day. As long as your cans are on the curb, we\'ll clean them on your scheduled date.</div>\r\n<div style=\"clear: both; height: 0px;\"></div>\r\n</div>\r\n<hr />\r\n<div class=\"title_left\" data-sr=\"move 16px scale up 20%, over 0.7s\">\r\n<h3 class=\"highlight1_title\">2</h3>\r\n<div class=\"title_left_text\">\r\n<div class=\"title_left_text_sub\">Q. Why should I have my trash and recycle bins cleaned?</div>\r\nA. We not only clean your cans, but we disinfect, sanitize and deodorize them as well. We use water temps of approximately 200 degrees fahrenheit which rids them 99.9% of bacteria, germs, and viruses. Additionally, we spray down the outside of the can including the parts most often touched such as the lid and handle. Our state-of-the-art system effectively reduces health hazards such as Tuberculosis, Strep, staph, E-Coli, Salmonella &amp; Listeria.</div>\r\n<div style=\"clear: both; height: 0px;\"></div>\r\n</div>\r\n<hr />\r\n<div class=\"title_left\" data-sr=\"move 16px scale up 20%, over 0.7s\">\r\n<h3 class=\"highlight1_title\">3</h3>\r\n<div class=\"title_left_text\">\r\n<div class=\"title_left_text_sub\">Q. Do you clean both trash cans and recycle cans?</div>\r\nA. Yes. We recommend cleaning both, due to bacteria, viruses, and germs that build up on both types of cans.</div>\r\n<div style=\"clear: both; height: 0px;\"></div>\r\n</div>\r\n<hr />\r\n<div class=\"title_left\" data-sr=\"move 16px scale up 20%, over 0.7s\">\r\n<h3 class=\"highlight1_title\">4</h3>\r\n<div class=\"title_left_text\">\r\n<div class=\"title_left_text_sub\">Q. What areas do you service?</div>\r\nA. Beauty Bins proudly provides service to the Florida Keys.</div>\r\n<div style=\"clear: both; height: 0px;\"></div>\r\n</div>\r\n<hr />\r\n<div class=\"title_left\" data-sr=\"move 16px scale up 20%, over 0.7s\">\r\n<h3 class=\"highlight1_title\">5</h3>\r\n<div class=\"title_left_text\">\r\n<div class=\"title_left_text_sub\">Q. How do I start the service?</div>\r\nA. Visit our \"SERVICES\" section on this website to sign-up quickly and easily.</div>\r\n<div style=\"clear: both; height: 0px;\"></div>\r\n</div>\r\n<hr />\r\n<div class=\"title_left\" data-sr=\"move 16px scale up 20%, over 0.7s\">\r\n<h3 class=\"highlight1_title\">6</h3>\r\n<div class=\"title_left_text\">\r\n<div class=\"title_left_text_sub\">Q. How do I update my payment information?</div>\r\nA. Click on the <a href=\"index.php?option=com_users&amp;view=login&amp;Itemid=806\" style=\"color: #222222;\"><strong>CLIENT LOGIN</strong></a> button on the right edge of your screen. Click the SUBSCRIPTIONS tab that appears on the landing page. Under ACTIONS you should see an UPDATE button. Click the button and follow the prompts to update your payment information.</div>\r\n<div style=\"clear: both; height: 0px;\"></div>\r\n<hr />\r\n<div class=\"title_left\" data-sr=\"move 16px scale up 20%, over 0.7s\">\r\n<h3 class=\"highlight1_title\">7</h3>\r\n<div class=\"title_left_text\">\r\n<div class=\"title_left_text_sub\">Q. How do I pay for an order that\'s listed in my account as UNPAID?</div>\r\nA. Click on the <a href=\"index.php?option=com_users&amp;view=login&amp;Itemid=806\" style=\"color: #222222;\"><strong>CLIENT LOGIN</strong></a> button on the right edge of your screen. Once you\'re logged in, you\'ll be taken to your profile. Notice that all of your orders are displayed on this page. Locate the order you need to pay. To the right of the order is a <strong>PAY</strong> link. Click this link. On the next page, click \"<strong>Pay with Bank or Credit Card</strong>\" which will already be ticked. Once you do this, the module will expand and you\'ll be able to add your updated credit card information. Follow the prompts to complete the process.</div>\r\n<div style=\"clear: both; height: 0px;\"></div>\r\n</div>\r\n</div>',1,'top_row3_1',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,0,'{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"white\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}',0,'*'),
