(1162,1014,'Step One Curbside Cleaning Visit','','<div class=\"large_text\">\r\n<h3>Step One</h3>\r\n<div class=\"large_text_sub\">\r\n<div class=\"lage_text_sub_line\">&nbsp;</div>\r\nCurbside Cleaning Visit</div>\r\nYour trash bin cleaning service starts with a scheduled pickup time and location. Our trucks wash your bins on the spot, so our customers dont have to wait for a return time. They can clean two containers simultaneously which makes your trash bin cleaning experience quick and easy.</div>\r\n<div class=\"packages_wrap\" data-sr=\"roll 10deg, over 0.7s\">\r\n<div class=\"package_row\">\r\n<div class=\"package_item package_blue\">\r\n<div class=\"package_item_img_wrap\"><img src=\"images/package4.jpg\" alt=\"\" /></div>\r\n<div class=\"package_item_text\">\r\n<h3></h3>\r\n<div class=\"package_item_price\"><span class=\"package_item_dollar_sign\"></span> <span class=\"package_item_dollar\"></span> <span class=\"package_item_cents\"></span></div>\r\n</div>\r\n</div>\r\n<div class=\"package_item package_red\">\r\n<div class=\"package_item_img_wrap\"><img src=\"images/package1.jpg\" alt=\"\" /></div>\r\n<div class=\"package_item_text\">\r\n<h3></h3>\r\n<div class=\"package_item_price\"><span class=\"package_item_dollar_sign\"></span> <span class=\"package_item_dollar\"></span> <span class=\"package_item_cents\"></span></div>\r\n</div>\r\n</div>\r\n<div style=\"clear: both:height:0px;\"></div>\r\n</div>\r\n<div class=\"package_row\">\r\n<div class=\"package_item package_orange\">\r\n<div class=\"package_item_img_wrap\"><img src=\"images/package2.jpg\" alt=\"\" /></div>\r\n<div class=\"package_item_text\">\r\n<h3></h3>\r\n<div class=\"package_item_price\"><span class=\"package_item_dollar_sign\"></span> <span class=\"package_item_dollar\"></span> <span class=\"package_item_cents\"></span></div>\r\n</div>\r\n</div>\r\n<div class=\"package_item package_green\">\r\n<div class=\"package_item_img_wrap\"><img src=\"images/package3.jpg\" alt=\"\" /></div>\r\n<div clas