(1163,1015,'Step Two Clean & Disinfect','','<div class=\"large_text\">\r\n<h3>Step Two</h3>\r\n<div class=\"large_text_sub\">\r\n<div class=\"lage_text_sub_line\">&nbsp;</div>\r\nClean & Disinfect</div>\r\nCleaning your trash bin only takes 30 seconds. Our 360 cleaning heads remove dirt and debris from every nook and cranny of your trash bin. Blasting water at over 200 degrees while pairing it with a disinfectant kills all festering bacteria promoting true cleanliness.</div>\r\n<div class=\"packages_wrap\" data-sr=\"roll 10deg, over 0.7s\">\r\n<div class=\"package_row\">\r\n<div class=\"package_item package_blue\">\r\n<div class=\"package_item_img_wrap\"><img src=\"images/Step_2.jpg\" alt=\"\" /></div>\r\n<div class=\"package_item_text\">\r\n<h3></h3>\r\n<div class=\"package_item_price\"><span class=\"package_item_dollar_sign\"></span> <span class=\"package_item_dollar\"></span> <span class=\"package_item_cents\"></span></div>\r\n</div>\r\n</div>\r\n<div class=\"package_item package_red\">\r\n<div class=\"package_item_img_wrap\"><img src=\"images/Clean-1.jpg\" alt=\"\" /></div>\r\n<div class=\"package_item_text\">\r\n<h3></h3>\r\n<div class=\"package_item_price\"><span class=\"package_item_dollar_sign\"></span> <span class=\"package_item_dollar\"></span> <span class=\"package_item_cents\"></span></div>\r\n</div>\r\n</div>\r\n<div style=\"clear: both:height:0px;\"></div>\r\n</div>\r\n<div class=\"package_row\">\r\n<div class=\"package_item package_orange\">\r\n<div class=\"package_item_img_wrap\"><img src=\"images/Clean-2.jpg\" alt=\"\" /></div>\r\n<div class=\"package_item_text\">\r\n<h3></h3>\r\n<div class=\"package_item_price\"><span class=\"package_item_dollar_sign\"></span> <span class=\"package_item_dollar\"></span> <span class=\"package_item_cents\"></span></div>\r\n</div>\r\n</div>\r\n<div class=\"package_item package_green\">\r\n<div class=\"package_item_img_wrap\"><img src=\"images/Clean-3.jpg\" alt=\"\" /></div>\r\n<div class=\"package_item_text\">\r\n<h3>