(1210,1064,'Composite Steps','','<video poster=\"/images/video_preload.jpg\" autoplay=\"autoplay\" loop=\"loop\" muted=\"\" controls=\"controls\" width=\"100%\" height=\"100%\" playsinline=\"playsinline\" style=\"display: block; margin-left: auto; margin-right: auto; width: 100%; height: 100%;\"><source src=\"/images/video.mp4\" type=\"video/mp4\" /> </video>\r\n<div class=\"large_text\">\r\n<h3>Step One</h3>\r\n<div class=\"large_text_sub\">\r\n<div class=\"lage_text_sub_line\"></div>\r\nCurbside Cleaning Visit</div>\r\nYour trash bin cleaning service starts with a scheduled pickup time and location. Our trucks wash your bins on the spot, so our customers dont have to wait for a return time. They can clean two containers simultaneously which makes your trash bin cleaning experience quick and easy.</div>\r\n<hr />\r\n<div class=\"large_text\">\r\n<h3>Step Two</h3>\r\n<div class=\"large_text_sub\">\r\n<div class=\"lage_text_sub_line\"></div>\r\nClean &amp; Disinfect</div>\r\nCleaning your trash bin only takes 30 seconds. Our 360<span id=\"degree-symbol\" class=\"font3\"></span> cleaning heads remove dirt and debris from every nook and cranny of your trash bin. Blasting water at over 200 degrees while pairing it with a disinfectant kills all festering bacteria promoting true cleanliness.</div>\r\n<hr />\r\n<div class=\"large_text\">\r\n<h3>Step Three</h3>\r\n<div class=\"large_text_sub\">\r\n<div class=\"lage_text_sub_line\"></div>\r\nDeodorize</div>\r\nAfter trash bins are sanitized and disinfected, we hand spray each bin with a deodorizer for an added touch of cleanliness.</div>\r\n<hr />\r\n<div class=\"large_text\">\r\n<h3>Step Four</h3>\r\n<div class=\"large_text_sub\">\r\n<div class=\"lage_text_sub_line\"></div>\r\nDone</div>\r\nWe will place your trash bins in your desired location, ensuring you that it is clean, disinfected and deodorized.</div>',1,'below_columns_1',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,0,'{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}',0,'*'),
